INSERT INTO `tributo_cfop` (`id`, `cod_cfop`, `nome`, `descricao`) VALUES
	(1, '0.000', 'Todos', 'Todos'),
	(3, '1.101', 'Compra para industrialização', 'Classificam-se neste código as compras de mercadorias a serem utilizadas em processo de industrialização. Também serão classificadas neste código as entradas de mercadorias em estabelecimento industrial de cooperativa recebidas de seus cooperados ou de estabelecimento de outra cooperativa.'),
	(4, '1.102', 'Compra para comercialização', 'Classificam-se neste código as compras de mercadorias a serem comercializadas. Também serão classificadas neste código as entradas de mercadorias em estabelecimento comercial de cooperativa recebidas de seus cooperados ou de estabelecimento de outra cooperativa.'),
	(5, '1.111', 'Compra para industrialização de mercadoria recebida anteriormente em consignação industrial', 'Classificam-se neste código as compras efetivas de mercadorias a serem utilizadas em processo de industrialização, recebidas anteriormente a título de consignação industrial.'),
	(6, '1.113', 'Compra para comercialização de mercadoria recebida anteriormente em consignação mercantil', 'Classificam-se neste código as compras efetivas de mercadorias recebidas anteriormente a título de consignação mercantil.'),
	(7, '1.116', 'Compra para industrialização originada de encomenda para recebimento futuro', 'Classificam-se neste código as compras de mercadorias a serem utilizadas em processo de industrialização, quando da entrada real da mercadoria, cuja aquisição tenha sido classificada no código 1.922 - Lançamento efetuado a título de simples faturamento decorrente de compra para recebimento futuro.'),
	(8, '1.117', 'Compra para comercialização originada de encomenda para recebimento futuro', 'Classificam-se neste código as compras de mercadorias a serem comercializadas, quando da entrada real da mercadoria, cuja aquisição tenha sido classificada no código 1.922 - Lançamento efetuado a título de simples faturamento decorrente de compra para recebimento futuro.'),
	(9, '1.118', 'Compra de mercadoria para comercialização pelo adquirente originário, entregue pelo vendedor remetente ao destinatário, em venda à ordem', 'Classificam-se neste código as compras de mercadorias já comercializadas, que, sem transitar pelo estabelecimento do adquirente originário, sejam entregues pelo vendedor remetente diretamente ao destinatário, em operação de venda à ordem, cuja venda seja classificada, pelo adquirente originário, no código 5.120 - Venda de mercadoria adquirida ou recebida de terceiros entregue ao destinatário pelo vendedor remetente, em venda à ordem.'),
	(10, '1.120', 'Compra para industrialização, em venda à ordem, já recebida do vendedor remetente', 'Classificam-se neste código as compras de mercadorias a serem utilizadas em processo de industrialização, em vendas à ordem, já recebidas do vendedor remetente, por ordem do adquirente originário.'),
	(11, '1.121', 'Compra para comercialização, em venda à ordem, já recebida do vendedor remetente', 'Classificam-se neste código as compras de mercadorias a serem comercializadas, em vendas à ordem, já recebidas do vendedor remetente por ordem do adquirente originário.'),
	(12, '1.122', 'Compra para industrialização em que a mercadoria foi remetida pelo fornecedor ao industrializador sem transitar pelo estabelecimento adquirente', 'Classificam-se neste código as compras de mercadorias a serem utilizadas em processo de industrialização, remetidas pelo fornecedor para o industrializador sem que a mercadoria tenha transitado pelo estabelecimento do adquirente.'),
	(13, '1.124', 'Industrialização efetuada por outra empresa', 'Classificam-se neste código as entradas de mercadorias industrializadas por terceiros, compreendendo os valores referentes aos serviços prestados e os das mercadorias de propriedade do industrializador empregadas no processo industrial. Quando a industrialização efetuada se referir a bens do ativo imobilizado ou de mercadorias para uso ou consumo do estabelecimento encomendante, a entrada deverá ser classificada nos códigos 1.551 - Compra de bem para o ativo imobilizado ou 1.556 - Compra de material para uso ou consumo.'),
	(14, '1.125', 'Industrialização efetuada por outra empresa quando a mercadoria remetida para utilização no processo de industrialização não transitou pelo estabelecimento adquirente da mercadoria', 'Classificam-se neste código as entradas de mercadorias industrializadas por outras empresas, em que as mercadorias remetidas para utilização no processo de industrialização não transitaram pelo estabelecimento do adquirente das mercadorias, compreendendo os valores referentes aos serviços prestados e os das mercadorias de propriedade do industrializador empregadas no processo industrial. Quando a industrialização efetuada se referir a bens do ativo imobilizado ou de mercadorias para uso ou consumo do estabelecimento encomendante, a entrada deverá ser classificada nos códigos 1.551 - Compra de bem para o ativo imobilizado ou 1.556 - Compra de material para uso ou consumo.'),
	(15, '1.126', 'Compra para utilização na prestação de serviço', 'Classificam-se neste código as entradas de mercadorias a serem utilizadas nas prestações de serviços.'),
	(18, '1.151', 'Transferência para industrialização', 'Classificam-se neste código as entradas de mercadorias recebidas em transferência de outro estabelecimento da mesma empresa, para serem utilizadas em processo de industrialização.'),
	(19, '1.152', 'Transferência para comercialização', 'Classificam-se neste código as entradas de mercadorias recebidas em transferência de outro estabelecimento da mesma empresa, para serem comercializadas.'),
	(20, '1.153', 'Transferência de energia elétrica para distribuição', 'Classificam-se neste código as entradas de energia elétrica recebida em transferência de outro estabelecimento da mesma empresa, para distribuição.'),
	(21, '1.154', 'Transferência para utilização na prestação de serviço', 'Classificam-se neste código as entradas de mercadorias recebidas em transferência de outro estabelecimento da mesma empresa, para serem utilizadas nas prestações de serviços.'),
	(24, '1.201', 'Devolução de venda de produção do estabelecimento', 'Classificam-se neste código as devoluções de vendas de produtos industrializados pelo estabelecimento, cujas saídas tenham sido classificadas como Venda de produção do estabelecimento.'),
	(25, '1.202', 'Devolução de venda de mercadoria adquirida ou recebida de terceiros', 'Classificam-se neste código as devoluções de vendas de mercadorias adquiridas ou recebidas de terceiros, que não tenham sido objeto de industrialização no estabelecimento, cujas saídas tenham sido classificadas como Venda de mercadoria adquirida ou recebida de terceiros.'),
	(26, '1.203', 'Devolução de venda de produção do estabelecimento, destinada à Zona Franca de Manaus ou Áreas de Livre Comércio', 'Classificam-se neste código as devoluções de vendas de produtos industrializados pelo estabelecimento, cujas saídas foram classificadas no código 5.109 - Venda de produção do estabelecimento, destinada à Zona Franca de Manaus ou Áreas de Livre Comércio.'),
	(27, '1.204', 'Devolução de venda de mercadoria adquirida ou recebida de terceiros, destinada à Zona Franca de Manaus ou Áreas de Livre Comércio', 'Classificam-se neste código as devoluções de vendas de mercadorias adquiridas ou recebidas de terceiros, cujas saídas foram classificadas no código 5.110 - Venda de mercadoria adquirida ou recebida de terceiros, destinada à Zona Franca de Manaus ou Áreas de Livre Comércio.'),
	(28, '1.205', 'Anulação de valor relativo à prestação de serviço de comunicação', 'Classificam-se neste código as anulações correspondentes a valores faturados indevidamente, decorrentes de prestações de serviços de comunicação.'),
	(29, '1.206', 'Anulação de valor relativo à prestação de serviço de transporte', 'Classificam-se neste código as anulações correspondentes a valores faturados indevidamente, decorrentes de prestações de serviços de transporte.'),
	(30, '1.207', 'Anulação de valor relativo à venda de energia elétrica', 'Classificam-se neste código as anulações correspondentes a valores faturados indevidamente, decorrentes de venda de energia elétrica.'),
	(31, '1.208', 'Devolução de produção do estabelecimento, remetida em transferência', 'Classificam-se neste código as devoluções de produtos industrializados pelo estabelecimento, transferidos para outros estabelecimentos da mesma empresa.'),
	(32, '1.209', 'Devolução de mercadoria adquirida ou recebida de terceiros, remetida em transferência', 'Classificam-se neste código as devoluções de mercadorias adquiridas ou recebidas de terceiros, transferidas para outros estabelecimentos da mesma empresa.'),
	(35, '1.251', 'Compra de energia elétrica para distribuição ou comercialização', 'Classificam-se neste código as compras de energia elétrica utilizada em sistema de distribuição ou comercialização. Também serão classificadas neste código as compras de energia elétrica por cooperativas para distribuição aos seus cooperados.'),
	(36, '1.252', 'Compra de energia elétrica por estabelecimento industrial', 'Classificam-se neste código as compras de energia elétrica utilizada no processo de industrialização. Também serão classificadas neste código as compras de energia elétrica utilizada por estabelecimento industrial de cooperativa.'),
	(37, '1.253', 'Compra de energia elétrica por estabelecimento comercial', 'Classificam-se neste código as compras de energia elétrica utilizada por estabelecimento comercial. Também serão classificadas neste código as compras de energia elétrica utilizada por estabelecimento comercial de cooperativa.'),
	(38, '1.254', 'Compra de energia elétrica por estabelecimento prestador de serviço de transporte', 'Classificam-se neste código as compras de energia elétrica utilizada por estabelecimento prestador de serviços de transporte.'),
	(39, '1.255', 'Compra de energia elétrica por estabelecimento prestador de serviço de comunicação', 'Classificam-se neste código as compras de energia elétrica utilizada por estabelecimento prestador de serviços de comunicação.'),
	(40, '1.256', 'Compra de energia elétrica por estabelecimento de produtor rural', 'Classificam-se neste código as compras de energia elétrica utilizada por estabelecimento de produtor rural.'),
	(41, '1.257', 'Compra de energia elétrica para consumo por demanda contratada', 'Classificam-se neste código as compras de energia elétrica para consumo por demanda contratada, que prevalecerá sobre os demais códigos deste subgrupo.'),
	(44, '1.301', 'Aquisição de serviço de comunicação para execução de serviço da mesma natureza', 'Classificam-se neste código as aquisições de serviços de comunicação utilizados nas prestações de serviços da mesma natureza.'),
	(45, '1.302', 'Aquisição de serviço de comunicação por estabelecimento industrial', 'Classificam-se neste código as aquisições de serviços de comunicação utilizados por estabelecimento industrial. Também serão classificadas neste código as aquisições de serviços de comunicação utilizados por estabelecimento industrial de cooperativa.'),
	(46, '1.303', 'Aquisição de serviço de comunicação por estabelecimento comercial', 'Classificam-se neste código as aquisições de serviços de comunicação utilizados por estabelecimento comercial. Também serão classificadas neste código as aquisições de serviços de comunicação utilizados por estabelecimento comercial de cooperativa.'),
	(47, '1.304', 'Aquisição de serviço de comunicação por estabelecimento de prestador de serviço de transporte', 'Classificam-se neste código as aquisições de serviços de comunicação utilizados por estabelecimento prestador de serviço de transporte.'),
	(48, '1.305', 'Aquisição de serviço de comunicação por estabelecimento de geradora ou de distribuidora de energia elétrica', 'Classificam-se neste código as aquisições de serviços de comunicação utilizados por estabelecimento de geradora ou de distribuidora de energia elétrica.'),
	(50, '1.306', 'Aquisição de serviço de comunicação por estabelecimento de produtor rural', 'Classificam-se neste código as aquisições de serviços de comunicação utilizados por estabelecimento de produtor rural.'),
	(53, '1.351', 'Aquisição de serviço de transporte para execução de serviço da mesma natureza', 'Classificam-se neste código as aquisições de serviços de transporte utilizados nas prestações de serviços da mesma natureza.'),
	(54, '1.352', 'Aquisição de serviço de transporte por estabelecimento industrial', 'Classificam-se neste código as aquisições de serviços de transporte utilizados por estabelecimento industrial. Também serão classificadas neste código as aquisições de serviços de transporte utilizados por estabelecimento industrial de cooperativa.'),
	(55, '1.353', 'Aquisição de serviço de transporte por estabelecimento comercial', 'Classificam-se neste código as aquisições de serviços de transporte utilizados por estabelecimento comercial. Também serão classificadas neste código as aquisições de serviços de transporte utilizados por estabelecimento comercial de cooperativa.'),
	(56, '1.354', 'Aquisição de serviço de transporte por estabelecimento de prestador de serviço de comunicação', 'Classificam-se neste código as aquisições de serviços de transporte utilizados por estabelecimento prestador de serviços de comunicação.'),
	(57, '1.355', 'Aquisição de serviço de transporte por estabelecimento de geradora ou de distribuidora de energia elétrica', 'Classificam-se neste código as aquisições de serviços de transporte utilizados por estabelecimento de geradora ou de distribuidora de energia elétrica.'),
	(58, '1.356', 'Aquisição de serviço de transporte por estabelecimento de produtor rural', 'Classificam-se neste código as aquisições de serviços de transporte utilizados por estabelecimento de produtor rural.'),
	(61, '1.401', 'Compra para industrialização em operação com mercadoria sujeita ao regime de substituição tributária', 'Classificam-se neste código as compras de mercadorias a serem utilizadas em processo de industrialização, decorrentes de operações com mercadorias sujeitas ao regime de substituição tributária. Também serão classificadas neste código as compras por estabelecimento industrial de cooperativa de mercadorias sujeitas ao regime de substituição tributária.'),
	(62, '1.403', 'Compra para comercialização em operação com mercadoria sujeita ao regime de substituição tributária', 'Classificam-se neste código as compras de mercadorias a serem comercializadas, decorrentes de operações com mercadorias sujeitas ao regime de substituição tributária. Também serão classificadas neste código as compras de mercadorias sujeitas ao regime de substituição tributária em estabelecimento comercial de cooperativa.'),
	(63, '1.406', 'Compra de bem para o ativo imobilizado cuja mercadoria está sujeita ao regime de substituição tributária', 'Classificam-se neste código as compras de bens destinados ao ativo imobilizado do estabelecimento, em operações com mercadorias sujeitas ao regime de substituição tributária.'),
	(64, '1.407', 'Compra de mercadoria para uso ou consumo cuja mercadoria está sujeita ao regime de substituição tributária', 'Classificam-se neste código as compras de mercadorias destinadas ao uso ou consumo do estabelecimento, em operações com mercadorias sujeitas ao regime de substituição tributária.'),
	(65, '1.408', 'Transferência para industrialização em operação com mercadoria sujeita ao regime de substituição tributária', 'Classificam-se neste código as mercadorias recebidas em transferência de outro estabelecimento da mesma empresa, para serem industrializadas no estabelecimento, em operações com mercadorias sujeitas ao regime de substituição tributária.'),
	(66, '1.409', 'Transferência para comercialização em operação com mercadoria sujeita ao regime de substituição tributária', 'Classificam-se neste código as mercadorias recebidas em transferência de outro estabelecimento da mesma empresa, para serem comercializadas, decorrentes de operações sujeitas ao regime de substituição tributária.'),
	(67, '1.410', 'Devolução de venda de produção do estabelecimento em operação com produto sujeito ao regime de substituição tributária', 'Classificam-se neste código as devoluções de produtos industrializados e vendidos pelo estabelecimento, cujas saídas tenham sido classificadas como Venda de produção do estabelecimento em operação com produto sujeito ao regime de substituição tributária.'),
	(68, '1.411', 'Devolução de venda de mercadoria adquirida ou recebida de terceiros em operação com mercadoria sujeita ao regime de substituição tributária', 'Classificam-se neste código as devoluções de vendas de mercadorias adquiridas ou recebidas de terceiros, cujas saídas tenham sido classificadas como Venda de mercadoria adquirida ou recebida de terceiros em operação com mercadoria sujeita ao regime de substituição tributária.'),
	(69, '1.414', 'Retorno de produção do estabelecimento, remetida para venda fora do estabelecimento em operação com produto sujeito ao regime de substituição tributária', 'Classificam-se neste código as entradas, em retorno, de produtos industrializados pelo estabelecimento, remetidos para vendas fora do estabelecimento, inclusive por meio de veículos, em operações com produtos sujeitos ao regime de substituição tributária, e não comercializadas.'),
	(70, '1.415', 'Retorno de mercadoria adquirida ou recebida de terceiros, remetida para venda fora do estabelecimento em operação com mercadoria sujeita ao regime de substituição tributária', 'Classificam-se neste código as entradas, em retorno, de mercadorias adquiridas ou recebidas de terceiros remetidas para vendas fora do estabelecimento, inclusive por meio de veículos, em operações com mercadorias sujeitas ao regime de substituição tributária, e não comercializadas.'),
	(73, '1.451', 'Retorno de animal do estabelecimento produtor', 'Classificam-se neste código as entradas referentes ao retorno de animais criados pelo produtor no sistema integrado.'),
	(74, '1.452', 'Retorno de insumo não utilizado na produção', 'Classificam-se neste código o retorno de insumos não utilizados pelo produtor na criação de animais pelo sistema integrado.'),
	(77, '1.501', 'Entrada de mercadoria recebida com fim específico de exportação', 'Classificam-se neste código as entradas de mercadorias em estabelecimento de trading company, empresa comercial exportadora ou outro estabelecimento do remetente, com fim específico de exportação.'),
	(78, '1.503', 'Entrada decorrente de devolução de produto remetido com fim específico de exportação, de produção do estabelecimento', 'Classificam-se neste código as devoluções de produtos industrializados pelo estabelecimento, remetidos a trading company, a empresa comercial exportadora ou a outro estabelecimento do remetente, com fim específico de exportação, cujas saídas tenham sido classificadas no código 5.501 - Remessa de produção do estabelecimento, com fim específico de exportação.'),
	(79, '1.504', 'Entrada decorrente de devolução de mercadoria remetida com fim específico de exportação, adquirida ou recebida de terceiros', 'Classificam-se neste código as devoluções de mercadorias adquiridas ou recebidas de terceiros remetidas a trading company, a empresa comercial exportadora ou a outro estabelecimento do remetente, com fim específico de exportação, cujas saídas tenham sido classificadas no código 5.502 - Remessa de mercadoria adquirida ou recebida de terceiros, com fim específico de exportação.'),
	(82, '1.551', 'Compra de bem para o ativo imobilizado', 'Classificam-se neste código as compras de bens destinados ao ativo imobilizado do estabelecimento.'),
	(83, '1.552', 'Transferência de bem do ativo imobilizado', 'Classificam-se neste código as entradas de bens destinados ao ativo imobilizado recebidos em transferência de outro estabelecimento da mesma empresa.'),
	(84, '1.553', 'Devolução de venda de bem do ativo imobilizado', 'Classificam-se neste código as devoluções de vendas de bens do ativo imobilizado, cujas saídas tenham sido classificadas no código 5.551 - Venda de bem do ativo imobilizado.'),
	(85, '1.554', 'Retorno de bem do ativo imobilizado remetido para uso fora do estabelecimento', 'Classificam-se neste código as entradas por retorno de bens do ativo imobilizado remetidos para uso fora do estabelecimento, cujas saídas tenham sido classificadas no código 5.554 - Remessa de bem do ativo imobilizado para uso fora do estabelecimento.'),
	(86, '1.555', 'Entrada de bem do ativo imobilizado de terceiro, remetido para uso no estabelecimento', 'Classificam-se neste código as entradas de bens do ativo imobilizado de terceiros, remetidos para uso no estabelecimento.'),
	(87, '1.556', 'Compra de material para uso ou consumo', 'Classificam-se neste código as compras de mercadorias destinadas ao uso ou consumo do estabelecimento.'),
	(88, '1.557', 'Transferência de material para uso ou consumo', 'Classificam-se neste código as entradas de materiais para uso ou consumo recebidos em transferência de outro estabelecimento da mesma empresa.'),
	(91, '1.601', 'Recebimento, por transferência, de crédito de ICMS', 'Classificam-se neste código os lançamentos destinados ao registro de créditos de ICMS, recebidos por transferência de outras empresas.'),
	(92, '1.602', 'Recebimento, por transferência, de saldo credor de ICMS de outro estabelecimento da mesma empresa, para compensação de saldo devedor de ICMS', 'Classificam-se neste código os lançamentos destinados ao registro da transferência de saldos credores de ICMS recebidos de outros estabelecimentos da mesma empresa, destinados à compensação do saldo devedor do estabelecimento, inclusive no caso de apuração centralizada do imposto.'),
	(93, '1.603', 'Ressarcimento de ICMS retido por substituição tributária', 'Classificam-se neste código os lançamentos destinados ao registro de ressarcimento de ICMS retido por substituição tributária a contribuinte substituído, efetuado pelo contribuinte substituto, ou, ainda, quando o ressarcimento for apropriado pelo próprio contribuinte substituído, nas hipóteses previstas na legislação aplicável.'),
	(94, '1.604', 'Lançamento do crédito relativo à compra de bem para o ativo imobilizado', 'Classificam-se neste código os lançamentos destinados ao registro da apropriação de crédito de bens do ativo imobilizado.'),
	(97, '1.605', 'Recebimento, por transferência, de saldo devedor de ICMS de outro estabelecimento da mesma empresa.', 'Classificam-se neste código os lançamentos destinados ao registro da transferência de saldo devedor de ICMS recebido de outro estabelecimento da mesma empresa, para efetivação da apuração centralizada do imposto.'),
	(101, '1.651', 'Compra de combustível ou lubrificante para industrialização subsequente', 'Classificam-se neste código as compras de combustíveis ou lubrificantes a serem utilizados em processo de industrialização do próprio produto.'),
	(103, '1.652', 'Compra de combustível ou lubrificante para comercialização', 'Classificam-se neste código as compras de combustíveis ou lubrificantes a serem comercializados.'),
	(104, '1.653', 'Compra de combustível ou lubrificante por consumidor ou usuário final', 'Classificam-se neste código as compras de combustíveis ou lubrificantes a serem consumidos em processo de industrialização de outros produtos, na prestação de serviços ou por usuário final.'),
	(106, '1.658', 'Transferência de combustível e lubrificante para industrialização', 'Classificam-se neste código as entradas de combustíveis e lubrificantes recebidas em transferência de outro estabelecimento da mesma empresa para serem utilizados em processo de industrialização do próprio produto.'),
	(108, '1.659', 'Transferência de combustível e lubrificante para comercialização', 'Classificam-se neste código as entradas de combustíveis e lubrificantes recebidas em transferência de outro estabelecimento da mesma empresa para serem comercializados. '),
	(110, '1.660', 'Devolução de venda de combustível ou lubrificante destinado à industrialização subsequente', 'Classificam-se neste código as devoluções de vendas de combustíveis ou lubrificantes, cujas saídas tenham sido classificadas como  Venda de combustível ou lubrificante destinado à industrialização subsequente.'),
	(112, '1.661', 'Devolução de venda de combustível ou lubrificante destinado à comercialização', 'Classificam-se neste código as devoluções de vendas de combustíveis ou lubrificantes, cujas saídas tenham sido classificadas como Venda de combustíveis ou lubrificantes para comercialização.'),
	(114, '1.662', 'Devolução de venda de combustível ou lubrificante destinado a consumidor ou usuário final', 'Classificam-se neste código as devoluções de vendas de combustíveis ou lubrificantes, cujas saídas tenham sido classificadas como Venda de combustíveis ou lubrificantes por consumidor ou usuário final.'),
	(116, '1.663', 'Entrada de combustível ou lubrificante para armazenagem', 'Classificam-se neste código as entradas de combustíveis ou lubrificantes para armazenagem.'),
	(118, '1.664', 'Retorno de combustível ou lubrificante remetido para armazenagem', 'Classificam-se neste código as entradas, ainda que simbólicas, por retorno de combustíveis ou lubrificantes, remetidos para armazenagem.'),
	(122, '1.901', 'Entrada para industrialização por encomenda', 'Classificam-se neste código as entradas de insumos recebidos para industrialização por encomenda de outra empresa ou de outro estabelecimento da mesma empresa.'),
	(123, '1.902', 'Retorno de mercadoria remetida para industrialização por encomenda', 'Classificam-se neste código o retorno dos insumos remetidos para industrialização por encomenda, incorporados ao produto final pelo estabelecimento industrializador.'),
	(124, '1.903', 'Entrada de mercadoria remetida para industrialização e não aplicada no referido processo', 'Classificam-se neste código as entradas em devolução de insumos remetidos para industrialização e não aplicados no referido processo.'),
	(125, '1.904', 'Retorno de remessa para venda fora do estabelecimento', 'Classificam-se neste código as entradas em retorno de mercadorias remetidas para venda fora do estabelecimento, inclusive por meio de veículos, e não comercializadas.'),
	(126, '1.905', 'Entrada de mercadoria recebida para depósito em depósito fechado ou armazém geral', 'Classificam-se neste código as entradas de mercadorias recebidas para depósito em depósito fechado ou armazém geral.'),
	(127, '1.906', 'Retorno de mercadoria remetida para depósito fechado ou armazém geral', 'Classificam-se neste código as entradas em retorno de mercadorias remetidas para depósito em depósito fechado ou armazém geral.'),
	(128, '1.907', 'Retorno simbólico de mercadoria remetida para depósito fechado ou armazém geral', 'Classificam-se neste código as entradas em retorno simbólico de mercadorias remetidas para depósito em depósito fechado ou armazém geral, quando as mercadorias depositadas tenham sido objeto de saída a qualquer título e que não tenham retornado ao estabelecimento depositante.'),
	(129, '1.908', 'Entrada de bem por conta de contrato de comodato', 'Classificam-se neste código as entradas de bens recebidos em cumprimento de contrato de comodato.'),
	(130, '1.909', 'Retorno de bem remetido por conta de contrato de comodato', 'Classificam-se neste código as entradas de bens recebidos em devolução após cumprido o contrato de comodato.'),
	(131, '1.910', 'Entrada de bonificação, doação ou brinde', 'Classificam-se neste código as entradas de mercadorias recebidas a título de bonificação, doação ou brinde.'),
	(132, '1.911', 'Entrada de amostra grátis', 'Classificam-se neste código as entradas de mercadorias recebidas a título de amostra grátis.'),
	(133, '1.912', 'Entrada de mercadoria ou bem recebido para demonstração', 'Classificam-se neste código as entradas de mercadorias ou bens recebidos para demonstração.'),
	(134, '1.913', 'Retorno de mercadoria ou bem remetido para demonstração', 'Classificam-se neste código as entradas em retorno de mercadorias ou bens remetidos para demonstração.'),
	(135, '1.914', 'Retorno de mercadoria ou bem remetido para exposição ou feira', 'Classificam-se neste código as entradas em retorno de mercadorias ou bens remetidos para exposição ou feira.'),
	(136, '1.915', 'Entrada de mercadoria ou bem recebido para conserto ou reparo', 'Classificam-se neste código as entradas de mercadorias ou bens recebidos para conserto ou reparo.'),
	(137, '1.916', 'Retorno de mercadoria ou bem remetido para conserto ou reparo', 'Classificam-se neste código as entradas em retorno de mercadorias ou bens remetidos para conserto ou reparo.'),
	(138, '1.917', 'Entrada de mercadoria recebida em consignação mercantil ou industrial', 'Classificam-se neste código as entradas de mercadorias recebidas a título de consignação mercantil ou industrial.'),
	(139, '1.918', 'Devolução de mercadoria remetida em consignação mercantil ou industrial', 'Classificam-se neste código as entradas por devolução de mercadorias remetidas anteriormente a título de consignação mercantil ou industrial.'),
	(140, '1.919', 'Devolução simbólica de mercadoria vendida ou utilizada em processo industrial, remetida anteriormente em consignação mercantil ou industrial', 'Classificam-se neste código as entradas por devolução simbólica de mercadorias vendidas ou utilizadas em processo industrial, remetidas anteriormente a título de consignação mercantil ou industrial.'),
	(141, '1.920', 'Entrada de vasilhame ou sacaria', 'Classificam-se neste código as entradas de vasilhame ou sacaria.'),
	(142, '1.921', 'Retorno de vasilhame ou sacaria', 'Classificam-se neste código as entradas em retorno de vasilhame ou sacaria.'),
	(143, '1.922', 'Lançamento efetuado a título de simples faturamento decorrente de compra para recebimento futuro', 'Classificam-se neste código os registros efetuados a título de simples faturamento decorrente de compra para recebimento futuro.'),
	(144, '1.923', 'Entrada de mercadoria recebida do vendedor remetente, em venda à ordem', 'Classificam-se neste código as entradas de mercadorias recebidas do vendedor remetente, em vendas à ordem, cuja compra do adquirente originário, foi classificada nos códigos 1.120 - Compra para industrialização, em venda à ordem, já recebida do vendedor remetente ou 1.121 - Compra para comercialização, em venda à ordem, já recebida do vendedor remetente.'),
	(145, '1.924', 'Entrada para industrialização por conta e ordem do adquirente da mercadoria, quando esta não transitar pelo estabelecimento do adquirente', 'Classificam-se neste código as entradas de insumos recebidos para serem industrializados por conta e ordem do adquirente, nas hipóteses em que os insumos não tenham transitado pelo estabelecimento do adquirente dos mesmos.'),
	(146, '1.925', 'Retorno de mercadoria remetida para industrialização por conta e ordem do adquirente da mercadoria, quando esta não transitar pelo estabelecimento do adquirente', 'Classificam-se neste código o retorno dos insumos remetidos por conta e ordem do adquirente, para industrialização e incorporados ao produto final pelo estabelecimento industrializador, nas hipóteses em que os insumos não tenham transitado pelo estabelecimento do adquirente.'),
	(147, '1.926', 'Lançamento efetuado a título de reclassificação de mercadoria decorrente de formação de kit ou de sua desagregação', 'Classificam-se neste código os registros efetuados a título de reclassificação decorrente de formação de kit de mercadorias ou de sua desagregação.'),
	(148, '1.931', 'Lançamento efetuado pelo tomador do serviço de transporte quando a responsabilidade de retenção do imposto for atribuída ao remetente ou alienante da mercadoria, pelo serviço de transporte realizado por transportador autÃ´nomo ou por transportador não inscrito na unidade da Federação onde iniciado o serviço.', 'Classificam-se neste código exclusivamente os lançamentos efetuados pelo tomador do serviço de transporte realizado por transportador autÃ´nomo ou por transportador não inscrito na unidade da Federação, onde iniciado o serviço, quando a responsabilidade pela retenção do imposto for atribuída ao remetente ou alienante da mercadoria.'),
	(150, '1.932', 'Aquisição de serviço de transporte iniciado em unidade da Federação diversa daquela onde inscrito o prestador.', 'Classificam-se neste código as aquisições de serviços de transporte que tenham sido iniciados em unidade da Federação diversa daquela onde o prestador está inscrito como contribuinte.'),
	(151, '1.933', 'Aquisição de serviço tributado pelo ISSQN', 'Classificam-se neste código as aquisições de serviços, de competência municipal, desde que informados em documentos autorizados pelo Estado.'),
	(152, '1.949', 'Outra entrada de mercadoria ou prestação de serviço não especificada', 'Classificam-se neste código as outras entradas de mercadorias ou prestações de serviços que não tenham sido especificadas nos códigos anteriores.'),
	(157, '2.101', 'Compra para industrialização', 'Classificam-se neste código as compras de mercadorias a serem utilizadas em processo de industrialização. Também serão classificadas neste código as entradas de mercadorias em estabelecimento industrial de cooperativa recebidas de seus cooperados ou de estabelecimento de outra cooperativa.'),
	(158, '2.102', 'Compra para comercialização', 'Classificam-se neste código as compras de mercadorias a serem comercializadas. Também serão classificadas neste código as entradas de mercadorias em estabelecimento comercial de cooperativa recebidas de seus cooperados ou de estabelecimento de outra cooperativa.'),
	(159, '2.111', 'Compra para industrialização de mercadoria recebida anteriormente em consignação industrial', 'Classificam-se neste código as compras efetivas de mercadorias a serem utilizadas em processo de industrialização, recebidas anteriormente a título de consignação industrial.'),
	(160, '2.113', 'Compra para comercialização, de mercadoria recebida anteriormente em consignação mercantil', 'Classificam-se neste código as compras efetivas de mercadorias recebidas anteriormente a título de consignação mercantil.'),
	(161, '2.116', 'Compra para industrialização originada de encomenda para recebimento futuro', 'Classificam-se neste código as compras de mercadorias a serem utilizadas em processo de industrialização, quando da entrada real da mercadoria, cuja aquisição tenha sido classificada no código 2.922 - Lançamento efetuado a título de simples faturamento decorrente de compra para recebimento futuro.'),
	(162, '2.117', 'Compra para comercialização originada de encomenda para recebimento futuro', 'Classificam-se neste código as compras de mercadorias a serem comercializadas, quando da entrada real da mercadoria, cuja aquisição tenha sido classificada no código 2.922 - Lançamento efetuado a título de simples faturamento decorrente de compra para recebimento futuro.'),
	(163, '2.118', 'Compra de mercadoria para comercialização pelo adquirente originário, entregue pelo vendedor remetente ao destinatário, em venda à ordem', 'Classificam-se neste código as compras de mercadorias já comercializadas, que, sem transitar pelo estabelecimento do adquirente originário, sejam entregues pelo vendedor remetente diretamente ao destinatário, em operação de venda à ordem, cuja venda seja classificada, pelo adquirente originário, no código 6.120 - Venda de mercadoria adquirida ou recebida de terceiros entregue ao destinatário pelo vendedor remetente, em venda à ordem.'),
	(164, '2.120', 'Compra para industrialização, em venda à ordem, já recebida do vendedor remetente', 'Classificam-se neste código as compras de mercadorias a serem utilizadas em processo de industrialização, em vendas à ordem, já recebidas do vendedor remetente, por ordem do adquirente originário.'),
	(165, '2.121', 'Compra para comercialização, em venda à ordem, já recebida do vendedor remetente', 'Classificam-se neste código as compras de mercadorias a serem comercializadas, em vendas à ordem, já recebidas do vendedor remetente por ordem do adquirente originário.'),
	(166, '2.122', 'Compra para industrialização em que a mercadoria foi remetida pelo fornecedor ao industrializador sem transitar pelo estabelecimento adquirente', 'Classificam-se neste código as compras de mercadorias a serem utilizadas em processo de industrialização, remetidas pelo fornecedor para o industrializador sem que a mercadoria tenha transitado pelo estabelecimento do adquirente.'),
	(167, '2.124', 'Industrialização efetuada por outra empresa', 'Classificam-se neste código as entradas de mercadorias industrializadas por terceiros, compreendendo os valores referentes aos serviços prestados e os das mercadorias de propriedade do industrializador empregadas no processo industrial. Quando a industrialização efetuada se referir a bens do ativo imobilizado ou de mercadorias para uso ou consumo do estabelecimento encomendante, a entrada deverá ser classificada nos códigos 2.551 - Compra de bem para o ativo imobilizado ou 2.556 - Compra de material para uso ou consumo.'),
	(168, '2.125', 'Industrialização efetuada por outra empresa quando a mercadoria remetida para utilização no processo de industrialização não transitou pelo estabelecimento adquirente da mercadoria', 'Classificam-se neste código as entradas de mercadorias industrializadas por outras empresas, em que as mercadorias remetidas para utilização no processo de industrialização não transitaram pelo estabelecimento do adquirente das mercadorias, compreendendo os valores referentes aos serviços prestados e os das mercadorias de propriedade do industrializador empregadas no processo industrial. Quando a industrialização efetuada se referir a bens do ativo imobilizado ou de mercadorias para uso ou consumo do estabelecimento encomendante, a entrada deverá ser classificada nos códigos 2.551 - Compra de bem para o ativo imobilizado ou 2.556 - Compra de material para uso ou consumo.'),
	(169, '2.126', 'Compra para utilização na prestação de serviço', 'Classificam-se neste código as entradas de mercadorias a serem utilizadas nas prestações de serviços.'),
	(172, '2.151', 'Transferência para industrialização', 'Classificam-se neste código as entradas de mercadorias recebidas em transferência de outro estabelecimento da mesma empresa, para serem utilizadas em processo de industrialização.'),
	(173, '2.152', 'Transferência para comercialização', 'Classificam-se neste código as entradas de mercadorias recebidas em transferência de outro estabelecimento da mesma empresa, para serem comercializadas.'),
	(174, '2.153', 'Transferência de energia elétrica para distribuição', 'Classificam-se neste código as entradas de energia elétrica recebida em transferência de outro estabelecimento da mesma empresa, para distribuição.'),
	(175, '2.154', 'Transferência para utilização na prestação de serviço', 'Classificam-se neste código as entradas de mercadorias recebidas em transferência de outro estabelecimento da mesma empresa, para serem utilizadas nas prestações de serviços.'),
	(178, '2.201', 'Devolução de venda de produção do estabelecimento', 'Classificam-se neste código as devoluções de vendas de produtos industrializados pelo estabelecimento, cujas saídas tenham sido classificadas como Venda de produção do estabelecimento.'),
	(179, '2.202', 'Devolução de venda de mercadoria adquirida ou recebida de terceiros', 'Classificam-se neste código as devoluções de vendas de mercadorias adquiridas ou recebidas de terceiros, que não tenham sido objeto de industrialização no estabelecimento, cujas saídas tenham sido classificadas como Venda de mercadoria adquirida ou recebida de terceiros.'),
	(180, '2.203', 'Devolução de venda de produção do estabelecimento, destinada à Zona Franca de Manaus ou Áreas de Livre Comércio', 'Classificam-se neste código as devoluções de vendas de produtos industrializados pelo estabelecimento, cujas saídas foram classificadas no código 6.109 - Venda de produção do estabelecimento, destinada à Zona Franca de Manaus ou Áreas de Livre Comércio.'),
	(181, '2.204', 'Devolução de venda de mercadoria adquirida ou recebida de terceiros, destinada à Zona Franca de Manaus ou Áreas de Livre Comércio', 'Classificam-se neste código as devoluções de vendas de mercadorias adquiridas ou recebidas de terceiros, cujas saídas foram classificadas no código 6.110 - Venda de mercadoria adquirida ou recebida de terceiros, destinada à Zona Franca de Manaus ou Áreas de Livre Comércio.'),
	(182, '2.205', 'Anulação de valor relativo à prestação de serviço de comunicação', 'Classificam-se neste código as anulações correspondentes a valores faturados indevidamente, decorrentes de prestações de serviços de comunicação.'),
	(183, '2.206', 'Anulação de valor relativo à prestação de serviço de transporte', 'Classificam-se neste código as anulações correspondentes a valores faturados indevidamente, decorrentes de prestações de serviços de transporte.'),
