	(280, '2.931', 'Lançamento efetuado pelo tomador do serviço de transporte quando a responsabilidade de retenção do imposto for atribuída ao remetente ou alienante da mercadoria, pelo serviço de transporte realizado por transportador autÃ´nomo ou por transportador não inscrito na unidade da Federação onde iniciado o serviço.', 'Classificam-se neste código exclusivamente os lançamentos efetuados pelo tomador do serviço de transporte realizado por transportador autÃ´nomo ou por transportador não inscrito na unidade da Federação, onde iniciado o serviço, quando a responsabilidade pela retenção do imposto for atribuída ao remetente ou alienante da mercadoria.'),
	(281, '2.932', 'Aquisição de serviço de transporte iniciado em unidade da Federação diversa daquela onde inscrito o prestador.', 'Classificam-se neste código as aquisições de serviços de transporte que tenham sido iniciados em unidade da Federação diversa daquela onde o prestador está inscrito como contribuinte.'),
	(282, '2.933', 'Aquisição de serviço tributado pelo ISSQN', 'Classificam-se neste código as aquisições de serviços, de competência municipal, desde que informados em documentos autorizados pelo Estado.'),
	(283, '2.949', 'Outra entrada de mercadoria ou prestação de serviço não especificado', 'Classificam-se neste código as outras entradas de mercadorias ou prestações de serviços que não tenham sido especificados nos códigos anteriores.'),
	(288, '3.101', 'Compra para industrialização', 'Classificam-se neste código as compras de mercadorias a serem utilizadas em processo de industrialização. Também serão classificadas neste código as entradas de mercadorias em estabelecimento industrial de cooperativa.'),
