	(291, '3.127', 'Compra para industrialização sob o regime de drawback', 'Classificam-se neste código as compras de mercadorias a serem utilizadas em processo de industrialização e posterior exportação do produto resultante, cujas vendas serão classificadas no código 7.127 - Venda de produção do estabelecimento sob o regime de drawback.'),
	(294, '3.201', 'Devolução de venda de produção do estabelecimento', 'Classificam-se neste código as devoluções de vendas de produtos industrializados pelo estabelecimento, cujas saídas tenham sido classificadas como Venda de produção do estabelecimento.'),
	(295, '3.202', 'Devolução de venda de mercadoria adquirida ou recebida de terceiros', 'Classificam-se neste código as devoluções de vendas de mercadorias adquiridas ou recebidas de terceiros, que não tenham sido objeto de industrialização no estabelecimento, cujas saídas tenham sido classificadas como Venda de mercadoria adquirida ou recebida de terceiros.'),
	(296, '3.205', 'Anulação de valor relativo à prestação de serviço de comunicação', 'Classificam-se neste código as anulações correspondentes a valores faturados indevidamente, decorrentes de prestações de serviços de comunicação.'),
	(297, '3.206', 'Anulação de valor relativo à prestação de serviço de transporte', 'Classificam-se neste código as anulações correspondentes a valores faturados indevidamente, decorrentes de prestações de serviços de transporte.'),
	(298, '3.207', 'Anulação de valor relativo à venda de energia elétrica', 'Classificam-se neste código as anulações correspondentes a valores faturados indevidamente, decorrentes de venda de energia elétrica.'),
	(299, '3.211', 'Devolução de venda de produção do estabelecimento sob o regime de drawback', 'Classificam-se neste código as devoluções de vendas de produtos industrializados pelo estabelecimento sob o regime de drawback.'),
	(302, '3.251', 'Compra de energia elétrica para distribuição ou comercialização', 'Classificam-se neste código as compras de energia elétrica utilizada em sistema de distribuição ou comercialização. Também serão classificadas neste código as compras de energia elétrica por cooperativas para distribuição aos seus cooperados.'),
	(305, '3.301', 'Aquisição de serviço de comunicação para execução de serviço da mesma natureza', 'Classificam-se neste código as aquisições de serviços de comunicação utilizados nas prestações de serviços da mesma natureza.'),
	(308, '3.351', 'Aquisição de serviço de transporte para execução de serviço da mesma natureza', 'Classificam-se neste código as aquisições de serviços de transporte utilizados nas prestações de serviços da mesma natureza.'),
	(309, '3.352', 'Aquisição de serviço de transporte por estabelecimento industrial', 'Classificam-se neste código as aquisições de serviços de transporte utilizados por estabelecimento industrial. Também serão classificadas neste código as aquisições de serviços de transporte utilizados por estabelecimento industrial de cooperativa.'),
	(310, '3.353', 'Aquisição de serviço de transporte por estabelecimento comercial', 'Classificam-se neste código as aquisições de serviços de transporte utilizados por estabelecimento comercial. Também serão classificadas neste código as aquisições de serviços de transporte utilizados por estabelecimento comercial de cooperativa.'),
	(311, '3.354', 'Aquisição de serviço de transporte por estabelecimento de prestador de serviço de comunicação', 'Classificam-se neste código as aquisições de serviços de transporte utilizados por estabelecimento prestador de serviços de comunicação.'),
	(312, '3.355', 'Aquisição de serviço de transporte por estabelecimento de geradora ou de distribuidora de energia elétrica', 'Classificam-se neste código as aquisições de serviços de transporte utilizados por estabelecimento de geradora ou de distribuidora de energia elétrica.'),
	(313, '3.356', 'Aquisição de serviço de transporte por estabelecimento de produtor rural', 'Classificam-se neste código as aquisições de serviços de transporte utilizados por estabelecimento de produtor rural.'),
	(316, '3.503', 'Devolução de mercadoria exportada que tenha sido recebida com fim específico de exportação', 'Classificam-se neste código as devoluções de mercadorias exportadas por trading company, empresa comercial exportadora ou outro estabelecimento do remetente, recebidas com fim específico de exportação, cujas saídas tenham sido classificadas no código 7.501 - Exportação de mercadorias recebidas com fim específico de exportação.'),
	(319, '3.551', 'Compra de bem para o ativo imobilizado', 'Classificam-se neste código as compras de bens destinados ao ativo imobilizado do estabelecimento.'),
	(320, '3.553', 'Devolução de venda de bem do ativo imobilizado', 'Classificam-se neste código as devoluções de vendas de bens do ativo imobilizado, cujas saídas tenham sido classificadas no código 7.551 - Venda de bem do ativo imobilizado.'),
	(321, '3.556', 'Compra de material para uso ou consumo', 'Classificam-se neste código as compras de mercadorias destinadas ao uso ou consumo do estabelecimento.'),
	(325, '3.651', 'Compra de combustível ou lubrificante para industrialização subsequente', 'Classificam-se neste código as compras de combustíveis ou lubrificantes a serem utilizados em processo de industrialização do próprio produto.'),
	(326, '3.652', 'Compra de combustível ou lubrificante para comercialização', 'Classificam-se neste código as compras de combustíveis ou lubrificantes a serem comercializados.'),
	(327, '3.653', 'Compra de combustível ou lubrificante por consumidor ou usuário final', 'Classificam-se neste código as compras de combustíveis ou lubrificantes a serem consumidos em processo de industrialização de outros produtos, na prestação de serviços ou por usuário final.'),
	(331, '3.930', 'Lançamento efetuado a título de entrada de bem sob amparo de regime especial aduaneiro de admissão temporária', 'Classificam-se neste código os lançamentos efetuados a título de entrada de bens amparada por regime especial aduaneiro de admissão temporária.'),
	(332, '3.949', 'Outra entrada de mercadoria ou prestação de serviço não especificado', 'Classificam-se neste código as outras entradas de mercadorias ou prestações de serviços que não tenham sido especificados nos códigos anteriores.'),
	(336, '5.101', 'Venda de produção do estabelecimento', 'Classificam-se neste código as vendas de produtos industrializados no estabelecimento. Também serão classificadas neste código as vendas de mercadorias por estabelecimento industrial de cooperativa destinadas a seus cooperados ou a estabelecimento de outra cooperativa.'),
	(337, '5.102', 'Venda de mercadoria adquirida ou recebida de terceiros', 'Classificam-se neste código as vendas de mercadorias adquiridas ou recebidas de terceiros para industrialização ou comercialização, que não tenham sido objeto de qualquer processo industrial no estabelecimento. Também serão classificadas neste código as vendas de mercadorias por estabelecimento comercial de cooperativa destinadas a seus cooperados ou estabelecimento de outra cooperativa.'),
	(338, '5.103', 'Venda de produção do estabelecimento, efetuada fora do estabelecimento', 'Classificam-se neste código as vendas efetuadas fora do estabelecimento, inclusive por meio de veículo, de produtos industrializados no estabelecimento.'),
	(339, '5.104', 'Venda de mercadoria adquirida ou recebida de terceiros, efetuada fora do estabelecimento', 'Classificam-se neste código as vendas efetuadas fora do estabelecimento, inclusive por meio de veículo, de mercadorias adquiridas ou recebidas de terceiros para industrialização ou comercialização, que não tenham sido objeto de qualquer processo industrial no estabelecimento.'),
	(340, '5.105', 'Venda de produção do estabelecimento que não deva por ele transitar', 'Classificam-se neste código as vendas de produtos industrializados no estabelecimento, armazenados em depósito fechado, armazém geral ou outro sem que haja retorno ao estabelecimento depositante.'),
	(341, '5.106', 'Venda de mercadoria adquirida ou recebida de terceiros, que não deva por ele transitar', 'Classificam-se neste código as vendas de mercadorias adquiridas ou recebidas de terceiros para industrialização ou comercialização, armazenadas em depósito fechado, armazém geral ou outro, que não tenham sido objeto de qualquer processo industrial no estabelecimento sem que haja retorno ao estabelecimento depositante. Também serão classificadas neste código as vendas de mercadorias importadas, cuja saída ocorra do recinto alfandegado ou da repartição alfandegária onde se processou o desembaraço aduaneiro, com destino ao estabelecimento do comprador, sem transitar pelo estabelecimento do importador.'),
	(342, '5.109', 'Venda de produção do estabelecimento, destinada à Zona Franca de Manaus ou Áreas de Livre Comércio', 'Classificam-se neste código as vendas de produtos industrializados pelo estabelecimento, destinados à Zona Franca de Manaus ou Áreas de Livre Comércio, desde que alcançados pelos benefícios fiscais de que tratam o Decreto-lei nÂ° 288, de 28 de fevereiro de 1967, o Convênio ICM 65/88, de 6 de dezembro de 1988, o Convênio ICMS 36/97, de 23 de maio de 1997 e o Convênio ICMS 37/97, de 23 de maio de 1997.'),
	(343, '5.110', 'Venda de mercadoria adquirida ou recebida de terceiros, destinada à Zona Franca de Manaus ou Áreas de Livre Comércio', 'Classificam-se neste código as vendas de mercadorias adquiridas ou recebidas de terceiros, destinadas à Zona Franca de Manaus ou Áreas de Livre Comércio, desde que alcançadas pelos benefícios fiscais de que tratam o Decreto-lei nÂ° 288, de 28 de fevereiro de 1967, o Convênio ICM 65/88, de 6 de dezembro de 1988, o Convênio ICMS 36/97, de 23 de maio de 1997 e o Convênio ICMS 37/97, de 23 de maio de 1997.'),
	(344, '5.111', 'Venda de produção do estabelecimento remetida anteriormente em consignação industrial', 'Classificam-se neste código as vendas efetivas de produtos industrializados no estabelecimento remetidos anteriormente a título de consignação industrial.'),
	(345, '5.112', 'Venda de mercadoria adquirida ou recebida de terceiros remetida anteriormente em consignação industrial', 'Classificam-se neste código as vendas efetivas de mercadorias adquiridas ou recebidas de terceiros, que não tenham sido objeto de qualquer processo industrial no estabelecimento, remetidas anteriormente a título de consignação industrial.'),
	(346, '5.113', 'Venda de produção do estabelecimento remetida anteriormente em consignação mercantil', 'Classificam-se neste código as vendas efetivas de produtos industrializados no estabelecimento remetidos anteriormente a título de consignação mercantil.'),
	(347, '5.114', 'Venda de mercadoria adquirida ou recebida de terceiros remetida anteriormente em consignação mercantil', 'Classificam-se neste código as vendas efetivas de mercadorias adquiridas ou recebidas de terceiros, que não tenham sido objeto de qualquer processo industrial no estabelecimento, remetidas anteriormente a título de consignação mercantil.'),
	(348, '5.115', 'Venda de mercadoria adquirida ou recebida de terceiros, recebida anteriormente em consignação mercantil', 'Classificam-se neste código as vendas de mercadorias adquiridas ou recebidas de terceiros, recebidas anteriormente a título de consignação mercantil.'),
	(349, '5.116', 'Venda de produção do estabelecimento originada de encomenda para entrega futura', 'Classificam-se neste código as vendas de produtos industrializados pelo estabelecimento, quando da saída real do produto, cujo faturamento tenha sido classificado no código 5.922 - Lançamento efetuado a título de simples faturamento decorrente de venda para entrega futura.'),
	(350, '5.117', 'Venda de mercadoria adquirida ou recebida de terceiros, originada de encomenda para entrega futura', 'Classificam-se neste código as vendas de mercadorias adquiridas ou recebidas de terceiros, que não tenham sido objeto de qualquer processo industrial no estabelecimento, quando da saída real da mercadoria, cujo faturamento tenha sido classificado no código 5.922 - Lançamento efetuado a título de simples faturamento decorrente de venda para entrega futura.'),
	(351, '5.118', 'Venda de produção do estabelecimento entregue ao destinatário por conta e ordem do adquirente originário, em venda à ordem', 'Classificam-se neste código as vendas à ordem de produtos industrializados pelo estabelecimento, entregues ao destinatário por conta e ordem do adquirente originário.'),
	(352, '5.119', 'Venda de mercadoria adquirida ou recebida de terceiros entregue ao destinatário por conta e ordem do adquirente originário, em venda à ordem', 'Classificam-se neste código as vendas à ordem de mercadorias adquiridas ou recebidas de terceiros, que não tenham sido objeto de qualquer processo industrial no estabelecimento, entregues ao destinatário por conta e ordem do adquirente originário.'),
	(353, '5.120', 'Venda de mercadoria adquirida ou recebida de terceiros entregue ao destinatário pelo vendedor remetente, em venda à ordem', 'Classificam-se neste código as vendas à ordem de mercadorias adquiridas ou recebidas de terceiros, que não tenham sido objeto de qualquer processo industrial no estabelecimento, entregues pelo vendedor remetente ao destinatário, cuja compra seja classificada, pelo adquirente originário, no código 1.118 - Compra de mercadoria para comercialização pelo adquirente originário, entregue pelo vendedor remetente ao destinatário, em venda à ordem.'),
	(354, '5.122', 'Venda de produção do estabelecimento remetida para industrialização, por conta e ordem do adquirente, sem transitar pelo estabelecimento do adquirente', 'Classificam-se neste código as vendas de produtos industrializados no estabelecimento, remetidos para serem industrializados em outro estabelecimento, por conta e ordem do adquirente, sem que os produtos tenham transitado pelo estabelecimento do adquirente.'),
	(355, '5.123', 'Venda de mercadoria adquirida ou recebida de terceiros remetida para industrialização, por conta e ordem do adquirente, sem transitar pelo estabelecimento do adquirente', 'Classificam-se neste código as vendas de mercadorias adquiridas ou recebidas de terceiros, que não tenham sido objeto de qualquer processo industrial no estabelecimento, remetidas para serem industrializadas em outro estabelecimento, por conta e ordem do adquirente, sem que as mercadorias tenham transitado pelo estabelecimento do adquirente.'),
	(356, '5.124', 'Industrialização efetuada para outra empresa', 'Classificam-se neste código as saídas de mercadorias industrializadas para terceiros, compreendendo os valores referentes aos serviços prestados e os das mercadorias de propriedade do industrializador empregadas no processo industrial.'),
	(357, '5.125', 'Industrialização efetuada para outra empresa quando a mercadoria recebida para utilização no processo de industrialização não transitar pelo estabelecimento adquirente da mercadoria', 'Classificam-se neste código as saídas de mercadorias industrializadas para outras empresas, em que as mercadorias recebidas para utilização no processo de industrialização não tenham transitado pelo estabelecimento do adquirente das mercadorias, compreendendo os valores referentes aos serviços prestados e os das mercadorias de propriedade do industrializador empregadas no processo industrial.'),
	(360, '5.151', 'Transferência de produção do estabelecimento', 'Classificam-se neste código os produtos industrializados no estabelecimento e transferidos para outro estabelecimento da mesma empresa.'),
	(361, '5.152', 'Transferência de mercadoria adquirida ou recebida de terceiros', 'Classificam-se neste código as mercadorias adquiridas ou recebidas de terceiros para industrialização, comercialização ou para utilização na prestação de serviços e que não tenham sido objeto de qualquer processo industrial no estabelecimento, transferidas para outro estabelecimento da mesma empresa.'),
	(362, '5.153', 'Transferência de energia elétrica', 'Classificam-se neste código as transferências de energia elétrica para outro estabelecimento da mesma empresa, para distribuição.'),
	(363, '5.155', 'Transferência de produção do estabelecimento, que não deva por ele transitar', 'Classificam-se neste código as transferências para outro estabelecimento da mesma empresa, de produtos industrializados no estabelecimento que tenham sido remetidos para armazém geral, depósito fechado ou outro, sem que haja retorno ao estabelecimento depositante.'),
	(364, '5.156', 'Transferência de mercadoria adquirida ou recebida de terceiros, que não deva por ele transitar', 'Classificam-se neste código as transferências para outro estabelecimento da mesma empresa, de mercadorias adquiridas ou recebidas de terceiros para industrialização ou comercialização, que não tenham sido objeto de qualquer processo industrial, remetidas para armazém geral, depósito fechado ou outro, sem que haja retorno ao estabelecimento depositante.'),
	(367, '5.201', 'Devolução de compra para industrialização', 'Classificam-se neste código as devoluções de mercadorias adquiridas para serem utilizadas em processo de industrialização, cujas entradas tenham sido classificadas como Compra para industrialização.'),
	(368, '5.202', 'Devolução de compra para comercialização', 'Classificam-se neste código as devoluções de mercadorias adquiridas para serem comercializadas, cujas entradas tenham sido classificadas como Compra para comercialização.'),
	(369, '5.205', 'Anulação de valor relativo a aquisição de serviço de comunicação', 'Classificam-se neste código as anulações correspondentes a valores faturados indevidamente, decorrentes das aquisições de serviços de comunicação.'),
	(370, '5.206', 'Anulação de valor relativo a aquisição de serviço de transporte', 'Classificam-se neste código as anulações correspondentes a valores faturados indevidamente, decorrentes das aquisições de serviços de transporte.'),
	(371, '5.207', 'Anulação de valor relativo à compra de energia elétrica', 'Classificam-se neste código as anulações correspondentes a valores faturados indevidamente, decorrentes da compra de energia elétrica.'),
	(372, '5.208', 'Devolução de mercadoria recebida em transferência para industrialização', 'Classificam-se neste código as devoluções de mercadorias recebidas em transferência de outros estabelecimentos da mesma empresa, para serem utilizadas em processo de industrialização.'),
	(373, '5.209', 'Devolução de mercadoria recebida em transferência para comercialização', 'Classificam-se neste código as devoluções de mercadorias recebidas em transferência de outro estabelecimento da mesma empresa, para serem comercializadas.'),
	(374, '5.210', 'Devolução de compra para utilização na prestação de serviço', 'Classificam-se neste código as devoluções de mercadorias adquiridas para utilização na prestação de serviços, cujas entradas tenham sido classificadas no código 1.126 - Compra para utilização na prestação de serviço.'),
	(377, '5.251', 'Venda de energia elétrica para distribuição ou comercialização', 'Classificam-se neste código as vendas de energia elétrica destinada à distribuição ou comercialização. Também serão classificadas neste código as vendas de energia elétrica destinada a cooperativas para distribuição aos seus cooperados.'),
	(378, '5.252', 'Venda de energia elétrica para estabelecimento industrial', 'Classificam-se neste código as vendas de energia elétrica para consumo por estabelecimento industrial. Também serão classificadas neste código as vendas de energia elétrica destinada a estabelecimento industrial de cooperativa.'),
	(379, '5.253', 'Venda de energia elétrica para estabelecimento comercial', 'Classificam-se neste código as vendas de energia elétrica para consumo por estabelecimento comercial. Também serão classificadas neste código as vendas de energia elétrica destinada a estabelecimento comercial de cooperativa.'),
	(380, '5.254', 'Venda de energia elétrica para estabelecimento prestador de serviço de transporte', 'Classificam-se neste código as vendas de energia elétrica para consumo por estabelecimento de prestador de serviços de transporte.'),
	(381, '5.255', 'Venda de energia elétrica para estabelecimento prestador de serviço de comunicação', 'Classificam-se neste código as vendas de energia elétrica para consumo por estabelecimento de prestador de serviços de comunicação.'),
	(382, '5.256', 'Venda de energia elétrica para estabelecimento de produtor rural', 'Classificam-se neste código as vendas de energia elétrica para consumo por estabelecimento de produtor rural.'),
	(383, '5.257', 'Venda de energia elétrica para consumo por demanda contratada', 'Classificam-se neste código as vendas de energia elétrica para consumo por demanda contratada, que prevalecerá sobre os demais códigos deste subgrupo.'),
	(384, '5.258', 'Venda de energia elétrica a não-contribuinte', 'Classificam-se neste código as vendas de energia elétrica a pessoas físicas ou a pessoas jurídicas não indicadas nos códigos anteriores.'),
	(387, '5.301', 'Prestação de serviço de comunicação para execução de serviço da mesma natureza', 'Classificam-se neste código as prestações de serviços de comunicação destinados às prestações de serviços da mesma natureza.'),
	(388, '5.302', 'Prestação de serviço de comunicação a estabelecimento industrial', 'Classificam-se neste código as prestações de serviços de comunicação a estabelecimento industrial. Também serão classificados neste código os serviços de comunicação prestados a estabelecimento industrial de cooperativa.'),
	(389, '5.303', 'Prestação de serviço de comunicação a estabelecimento comercial', 'Classificam-se neste código as prestações de serviços de comunicação a estabelecimento comercial. Também serão classificados neste código os serviços de comunicação prestados a estabelecimento comercial de cooperativa.'),
	(390, '5.304', 'Prestação de serviço de comunicação a estabelecimento de prestador de serviço de transporte', 'Classificam-se neste código as prestações de serviços de comunicação a estabelecimento prestador de serviço de transporte.'),
	(391, '5.305', 'Prestação de serviço de comunicação a estabelecimento de geradora ou de distribuidora de energia elétrica', 'Classificam-se neste código as prestações de serviços de comunicação a estabelecimento de geradora ou de distribuidora de energia elétrica.'),
	(392, '5.306', 'Prestação de serviço de comunicação a estabelecimento de produtor rural', 'Classificam-se neste código as prestações de serviços de comunicação a estabelecimento de produtor rural.'),
	(393, '5.307', 'Prestação de serviço de comunicação a não-contribuinte', 'Classificam-se neste código as prestações de serviços de comunicação a pessoas físicas ou a pessoas jurídicas não indicadas nos códigos anteriores.'),
	(396, '5.351', 'Prestação de serviço de transporte para execução de serviço da mesma natureza', 'Classificam-se neste código as prestações de serviços de transporte destinados às prestações de serviços da mesma natureza.'),
	(397, '5.352', 'Prestação de serviço de transporte a estabelecimento industrial', 'Classificam-se neste código as prestações de serviços de transporte a estabelecimento industrial. Também serão classificados neste código os serviços de transporte prestados a estabelecimento industrial de cooperativa.'),
	(398, '5.353', 'Prestação de serviço de transporte a estabelecimento comercial', 'Classificam-se neste código as prestações de serviços de transporte a estabelecimento comercial. Também serão classificados neste código os serviços de transporte prestados a estabelecimento comercial de cooperativa.'),
	(399, '5.354', 'Prestação de serviço de transporte a estabelecimento de prestador de serviço de comunicação', 'Classificam-se neste código as prestações de serviços de transporte a estabelecimento prestador de serviços de comunicação.'),
	(400, '5.355', 'Prestação de serviço de transporte a estabelecimento de geradora ou de distribuidora de energia elétrica', 'Classificam-se neste código as prestações de serviços de transporte a estabelecimento de geradora ou de distribuidora de energia elétrica.'),
	(401, '5.356', 'Prestação de serviço de transporte a estabelecimento de produtor rural', 'Classificam-se neste código as prestações de serviços de transporte a estabelecimento de produtor rural.'),
	(402, '5.357', 'Prestação de serviço de transporte a não-contribuinte', 'Classificam-se neste código as prestações de serviços de transporte a pessoas físicas ou a pessoas jurídicas não indicadas nos códigos anteriores.'),
	(403, '5.359', 'Prestação de serviço de transporte a contribuinte ou a não contribuinte quando a mercadoria transportada está dispensada de emissão de nota fiscal.', 'Classificam-se neste código as prestações de serviços de transporte a contribuintes ou a não contribuintes, exclusivamente quando não existe a obrigação legal de emissão de nota fiscal para a mercadoria transportada. '),
	(406, '5.401', 'Venda de produção do estabelecimento em operação com produto sujeito ao regime de substituição tributária, na condição de contribuinte substituto', 'Classificam-se neste código as vendas de produtos industrializados no estabelecimento em operações com produtos sujeitos ao regime de substituição tributária, na condição de contribuinte substituto. Também serão classificadas neste código as vendas de produtos industrializados por estabelecimento industrial de cooperativa sujeitos ao regime de substituição tributária, na condição de contribuinte substituto.'),
	(407, '5.402', 'Venda de produção do estabelecimento de produto sujeito ao regime de substituição tributária, em operação entre contribuintes substitutos do mesmo produto', 'Classificam-se neste código as vendas de produtos sujeitos ao regime de substituição tributária industrializados no estabelecimento, em operações entre contribuintes substitutos do mesmo produto.'),
	(408, '5.403', 'Venda de mercadoria adquirida ou recebida de terceiros em operação com mercadoria sujeita ao regime de substituição tributária, na condição de contribuinte substituto', 'Classificam-se neste código as vendas de mercadorias adquiridas ou recebidas de terceiros, na condição de contribuinte substituto, em operação com mercadorias sujeitas ao regime de substituição tributária.'),
	(409, '5.405', 'Venda de mercadoria adquirida ou recebida de terceiros em operação com mercadoria sujeita ao regime de substituição tributária, na condição de contribuinte substituído', 'Classificam-se neste código as vendas de mercadorias adquiridas ou recebidas de terceiros em operação com mercadorias sujeitas ao regime de substituição tributária, na condição de contribuinte substituído.'),
	(410, '5.408', 'Transferência de produção do estabelecimento em operação com produto sujeito ao regime de substituição tributária', 'Classificam-se neste código os produtos industrializados no estabelecimento e transferidos para outro estabelecimento da mesma empresa, em operações com produtos sujeitos ao regime de substituição tributária.'),
	(411, '5.409', 'Transferência de mercadoria adquirida ou recebida de terceiros em operação com mercadoria sujeita ao regime de substituição tributária', 'Classificam-se neste código as transferências para outro estabelecimento da mesma empresa, de mercadorias adquiridas ou recebidas de terceiros que não tenham sido objeto de qualquer processo industrial no estabelecimento, em operações com mercadorias sujeitas ao regime de substituição tributária.'),
	(412, '5.410', 'Devolução de compra para industrialização em operação com mercadoria sujeita ao regime de substituição tributária', 'Classificam-se neste código as devoluções de mercadorias adquiridas para serem utilizadas em processo de industrialização cujas entradas tenham sido classificadas como Compra para industrialização em operação com mercadoria sujeita ao regime de substituição tributária.'),
	(413, '5.411', 'Devolução de compra para comercialização em operação com mercadoria sujeita ao regime de substituição tributária', 'Classificam-se neste código as devoluções de mercadorias adquiridas para serem comercializadas, cujas entradas tenham sido classificadas como Compra para comercialização em operação com mercadoria sujeita ao regime de substituição tributária.'),
	(414, '5.412', 'Devolução de bem do ativo imobilizado, em operação com mercadoria sujeita ao regime de substituição tributária', 'Classificam-se neste código as devoluções de bens adquiridos para integrar o ativo imobilizado do estabelecimento, cuja entrada tenha sido classificada no código 1.406 - Compra de bem para o ativo imobilizado cuja mercadoria está sujeita ao regime de substituição tributária.'),
	(415, '5.413', 'Devolução de mercadoria destinada ao uso ou consumo, em operação com mercadoria sujeita ao regime de substituição tributária', 'Classificam-se neste código as devoluções de mercadorias adquiridas para uso ou consumo do estabelecimento, cuja entrada tenha sido classificada no código 1.407 - Compra de mercadoria para uso ou consumo cuja mercadoria está sujeita ao regime de substituição tributária.'),
	(416, '5.414', 'Remessa de produção do estabelecimento para venda fora do estabelecimento em operação com produto sujeito ao regime de substituição tributária', 'Classificam-se neste código as remessas de produtos industrializados pelo estabelecimento para serem vendidos fora do estabelecimento, inclusive por meio de veículos, em operações com produtos sujeitos ao regime de substituição tributária.'),
	(417, '5.415', 'Remessa de mercadoria adquirida ou recebida de terceiros para venda fora do estabelecimento, em operação com mercadoria sujeita ao regime de substituição tributária', 'Classificam-se neste código as remessas de mercadorias adquiridas ou recebidas de terceiros para serem vendidas fora do estabelecimento, inclusive por meio de veículos, em operações com mercadorias sujeitas ao regime de substituição tributária.'),
	(420, '5.451', 'Remessa de animal e de insumo para estabelecimento produtor', 'Classificam-se neste código as saídas referentes à remessa de animais e de insumos para criação de animais no sistema integrado, tais como: pintos, leitões, rações e medicamentos.'),
	(423, '5.501', 'Remessa de produção do estabelecimento, com fim específico de exportação', 'Classificam-se neste código as saídas de produtos industrializados pelo estabelecimento, remetidos com fim específico de exportação a trading company, empresa comercial exportadora ou outro estabelecimento do remetente.'),
	(424, '5.502', 'Remessa de mercadoria adquirida ou recebida de terceiros, com fim específico de exportação', 'Classificam-se neste código as saídas de mercadorias adquiridas ou recebidas de terceiros, remetidas com fim específico de exportação a trading company, empresa comercial exportadora ou outro estabelecimento do remetente.'),
	(425, '5.503', 'Devolução de mercadoria recebida com fim específico de exportação', 'Classificam-se neste código as devoluções efetuadas por trading company, empresa comercial exportadora ou outro estabelecimento do destinatário, de mercadorias recebidas com fim específico de exportação, cujas entradas tenham sido classificadas no código 1.501 - Entrada de mercadoria recebida com fim específico de exportação.'),
	(428, '5.551', 'Venda de bem do ativo imobilizado', 'Classificam-se neste código as vendas de bens integrantes do ativo imobilizado do estabelecimento.'),
	(429, '5.552', 'Transferência de bem do ativo imobilizado', 'Classificam-se neste código os bens do ativo imobilizado transferidos para outro estabelecimento da mesma empresa.'),
	(430, '5.553', 'Devolução de compra de bem para o ativo imobilizado', 'Classificam-se neste código as devoluções de bens adquiridos para integrar o ativo imobilizado do estabelecimento, cuja entrada foi classificada no código 1.551 - Compra de bem para o ativo imobilizado.'),
	(431, '5.554', 'Remessa de bem do ativo imobilizado para uso fora do estabelecimento', 'Classificam-se neste código as remessas de bens do ativo imobilizado para uso fora do estabelecimento.'),
	(432, '5.555', 'Devolução de bem do ativo imobilizado de terceiro, recebido para uso no estabelecimento', 'Classificam-se neste código as saídas em devolução, de bens do ativo imobilizado de terceiros, recebidos para uso no estabelecimento, cuja entrada tenha sido classificada no código 1.555 - Entrada de bem do ativo imobilizado de terceiro, remetido para uso no estabelecimento.'),
	(433, '5.556', 'Devolução de compra de material de uso ou consumo', 'Classificam-se neste código as devoluções de mercadorias destinadas ao uso ou consumo do estabelecimento, cuja entrada tenha sido classificada no código 1.556 - Compra de material para uso ou consumo.'),
	(434, '5.557', 'Transferência de material de uso ou consumo', 'Classificam-se neste código os materiais para uso ou consumo transferidos para outro estabelecimento da mesma empresa.'),
	(437, '5.601', 'Transferência de crédito de ICMS acumulado', 'Classificam-se neste código os lançamentos destinados ao registro da transferência de créditos de ICMS para outras empresas.'),
	(438, '5.602', 'Transferência de saldo credor de ICMS para outro estabelecimento da mesma empresa, destinado à compensação de saldo devedor de ICMS', 'Classificam-se neste código os lançamentos destinados ao registro da transferência de saldos credores de ICMS para outros estabelecimentos da mesma empresa, destinados à compensação do saldo devedor  do estabelecimento, inclusive no caso de apuração centralizada do imposto.'),
	(439, '5.603', 'Ressarcimento de ICMS retido por substituição tributária', 'Classificam-se neste código os lançamentos destinados ao registro de ressarcimento de ICMS retido por substituição tributária a contribuinte substituído, efetuado pelo contribuinte substituto, nas hipóteses previstas na legislação aplicável.'),
	(440, '5.605', 'Transferência de saldo devedor de ICMS de outro estabelecimento da mesma empresa.', 'Classificam-se neste código os lançamentos destinados ao registro da transferência de saldo devedor de ICMS para outro estabelecimento da mesma empresa, para efetivação da apuração centralizada do imposto.'),
	(442, '5.606', 'Utilização de saldo credor de ICMS para extinção por compensação de débitos fiscais.', 'Classificam-se neste código os lançamentos destinados ao registro de utilização de saldo credor de ICMS em conta gráfica para extinção por compensação de débitos fiscais desvinculados de conta gráfica. '),
	(445, '5.651', 'Venda de combustível ou lubrificante de produção do estabelecimento destinado à industrialização subsequente', 'Classificam-se neste código as vendas de combustíveis ou lubrificantes industrializados no estabelecimento destinados à industrialização do próprio produto, inclusive aquelas decorrentes de encomenda para entrega futura, cujo faturamento tenha sido classificado no código 5.922 â€“ Lançamento efetuado a título de simples faturamento decorrente de venda para entrega futura.'),
	(446, '5.652', 'Venda de combustível ou lubrificante de produção do estabelecimento destinado à comercialização', 'Classificam-se neste código as vendas de combustíveis ou lubrificantes industrializados no estabelecimento destinados à comercialização, inclusive aquelas decorrentes de encomenda para entrega futura, cujo faturamento tenha sido classificado no código 5.922 â€“ Lançamento efetuado a título de simples faturamento decorrente de venda para entrega futura.'),
	(447, '5.653', 'Venda de combustível ou lubrificante de produção do estabelecimento destinado a consumidor ou usuário final', 'Classificam-se neste código as vendas de combustíveis ou lubrificantes industrializados no estabelecimento destinados a consumo em processo de industrialização de outros produtos, à prestação de serviços ou a usuário final, inclusive aquelas decorrentes de encomenda para entrega futura, cujo faturamento tenha sido classificado no código 5.922 â€“ Lançamento efetuado a título de simples faturamento decorrente de venda para entrega futura.'),
	(448, '5.654', 'Venda de combustível ou lubrificante adquirido ou recebido de terceiros destinado à industrialização subsequente', 'Classificam-se neste código as vendas de  combustíveis ou lubrificantes adquiridos ou recebidos de terceiros destinados à industrialização do próprio produto, inclusive aquelas decorrentes de encomenda para entrega futura, cujo faturamento tenha sido classificado no código 5.922 â€“ Lançamento efetuado a título de simples faturamento decorrente de venda para entrega futura. '),
	(449, '5.655', 'Venda de combustível ou lubrificante adquirido ou recebido de terceiros destinado à comercialização', 'Classificam-se neste código as vendas de  combustíveis ou lubrificantes adquiridos ou recebidos de terceiros destinados à comercialização, inclusive aquelas decorrentes de encomenda para entrega futura, cujo faturamento tenha sido classificado no código 5.922 â€“ Lançamento efetuado a título de simples faturamento decorrente de venda para entrega futura.'),
	(450, '5.656', 'Venda de combustível ou lubrificante adquirido ou recebido de terceiros destinado a consumidor ou usuário final', 'Classificam-se neste código as vendas de combustíveis ou lubrificantes adquiridos ou recebidos de terceiros destinados a consumo em processo de industrialização de outros produtos, à prestação de serviços ou a usuário final, inclusive aquelas decorrentes de encomenda para entrega futura, cujo faturamento tenha sido classificado no código 5.922 â€“ Lançamento efetuado a título de simples faturamento decorrente de venda para entrega futura.'),
	(451, '5.657', 'Remessa de combustível ou lubrificante adquirido ou recebido de terceiros para venda fora do estabelecimento', 'Classificam-se neste código as remessas de combustíveis ou lubrificante, adquiridos ou recebidos de terceiros para serem vendidos fora do estabelecimento, inclusive por meio de veículos.'),
	(452, '5.658', 'Transferência de combustível ou lubrificante de produção do estabelecimento ', 'Classificam-se neste código as transferências de combustíveis ou lubrificantes, industrializados no estabelecimento, para outro estabelecimento da mesma empresa.'),
	(453, '5.659', 'Transferência de combustível ou lubrificante adquirido ou recebido de terceiro', 'Classificam-se neste código as transferências de combustíveis ou lubrificantes, adquiridos ou recebidos de terceiros, para outro estabelecimento da mesma empresa.'),
	(454, '5.660', 'Devolução de compra de combustível ou lubrificante adquirido para industrialização subsequente', 'Classificam-se neste código as devoluções de compras de combustíveis ou lubrificantes adquiridos para industrialização do próprio produto, cujas entradas tenham sido classificadas como Compra de combustível ou lubrificante para industrialização subsequente.'),
	(455, '5.661', 'Devolução de compra de combustível ou lubrificante adquirido para comercialização', 'Classificam-se neste código as devoluções de compras de combustíveis ou lubrificantes adquiridos para comercialização, cujas entradas tenham sido classificadas como Compra de combustível ou lubrificante para comercialização.'),
	(456, '5.662', 'Devolução de compra de combustível ou lubrificante adquirido por consumidor ou usuário final', 'Classificam-se neste código as devoluções de compras de combustíveis ou lubrificantes adquiridos para consumo em processo de industrialização de outros produtos, na prestação de serviços ou por usuário final, cujas entradas tenham sido classificadas como Compra de combustível ou lubrificante por consumidor ou usuário final.'),
	(457, '5.663', 'Remessa para armazenagem de combustível ou lubrificante', 'Classificam-se neste código as remessas para armazenagem de combustíveis ou lubrificantes.'),
	(458, '5.664', 'Retorno de combustível ou lubrificante recebido para armazenagem', 'Classificam-se neste código as remessas em devolução de combustíveis ou lubrificantes, recebidos para armazenagem.'),
	(459, '5.665', 'Retorno simbólico de combustível ou lubrificante recebido para armazenagem', 'Classificam-se neste código os retornos simbólicos de combustíveis ou lubrificantes recebidos para armazenagem, quando as mercadorias armazenadas tenham sido objeto de saída a qualquer título e não devam retornar ao estabelecimento depositante.'),
	(460, '5.666', 'Remessa por conta e ordem de terceiros de combustível ou lubrificante recebido para armazenagem', 'Classificam-se neste código as saídas por conta e ordem de terceiros, de combustíveis ou lubrificantes, recebidos anteriormente para armazenagem.'),
	(463, '5.901', 'Remessa para industrialização por encomenda', 'Classificam-se neste código as remessas de insumos remetidos para industrialização por encomenda, a ser realizada em outra empresa ou em outro estabelecimento da mesma empresa.'),
	(464, '5.902', 'Retorno de mercadoria utilizada na industrialização por encomenda', 'Classificam-se neste código as remessas, pelo estabelecimento industrializador, dos insumos recebidos para industrialização e incorporados ao produto final, por encomenda de outra empresa ou de outro estabelecimento da mesma empresa. O valor dos insumos nesta operação deverá ser igual ao valor dos insumos recebidos para industrialização.'),
	(465, '5.903', 'Retorno de mercadoria recebida para industrialização e não aplicada no referido processo', 'Classificam-se neste código as remessas em devolução de insumos recebidos para industrialização e não aplicados no referido processo.'),
	(466, '5.904', 'Remessa para venda fora do estabelecimento', 'Classificam-se neste código as remessas de mercadorias para venda fora do estabelecimento, inclusive por meio de veículos.'),
	(467, '5.905', 'Remessa para depósito fechado ou armazém geral', 'Classificam-se neste código as remessas de mercadorias para depósito em depósito fechado ou armazém geral.'),
	(468, '5.906', 'Retorno de mercadoria depositada em depósito fechado ou armazém geral', 'Classificam-se neste código os retornos de mercadorias depositadas em depósito fechado ou armazém geral ao estabelecimento depositante.'),
	(469, '5.907', 'Retorno simbólico de mercadoria depositada em depósito fechado ou armazém geral', 'Classificam-se neste código os retornos simbólicos de mercadorias recebidas para depósito em depósito fechado ou armazém geral, quando as mercadorias depositadas tenham sido objeto de saída a qualquer título e que não devam retornar ao estabelecimento depositante.'),
	(471, '5.908', 'Remessa de bem por conta de contrato de comodato', 'Classificam-se neste código as remessas de bens para o cumprimento de contrato de comodato.'),
	(472, '5.909', 'Retorno de bem recebido por conta de contrato de comodato', 'Classificam-se neste código as remessas de bens em devolução após cumprido o contrato de comodato.'),
	(473, '5.910', 'Remessa em bonificação, doação ou brinde', 'Classificam-se neste código as remessas de mercadorias a título de bonificação, doação ou brinde.'),
	(474, '5.911', 'Remessa de amostra grátis', 'Classificam-se neste código as remessas de mercadorias a título de amostra grátis.'),
	(475, '5.912', 'Remessa de mercadoria ou bem para demonstração', 'Classificam-se neste código as remessas de mercadorias ou bens para demonstração.'),
	(476, '5.913', 'Retorno de mercadoria ou bem recebido para demonstração', 'Classificam-se neste código as remessas em devolução de mercadorias ou bens recebidos para demonstração.'),
	(477, '5.914', 'Remessa de mercadoria ou bem para exposição ou feira', 'Classificam-se neste código as remessas de mercadorias ou bens para exposição ou feira.'),
	(478, '5.915', 'Remessa de mercadoria ou bem para conserto ou reparo', 'Classificam-se neste código as remessas de mercadorias ou bens para conserto ou reparo.'),
	(479, '5.916', 'Retorno de mercadoria ou bem recebido para conserto ou reparo', 'Classificam-se neste código as remessas em devolução de mercadorias ou bens recebidos para conserto ou reparo.'),
	(480, '5.917', 'Remessa de mercadoria em consignação mercantil ou industrial', 'Classificam-se neste código as remessas de mercadorias a título de consignação mercantil ou industrial.'),
	(481, '5.918', 'Devolução de mercadoria recebida em consignação mercantil ou industrial', 'Classificam-se neste código as devoluções de mercadorias recebidas anteriormente a título de consignação mercantil ou industrial.'),
	(482, '5.919', 'Devolução simbólica de mercadoria vendida ou utilizada em processo industrial, recebida anteriormente em consignação mercantil ou industrial', 'Classificam-se neste código as devoluções simbólicas de mercadorias vendidas ou utilizadas em processo industrial, que tenham sido recebidas anteriormente a título de consignação mercantil ou industrial.'),
	(483, '5.920', 'Remessa de vasilhame ou sacaria', 'Classificam-se neste código as remessas de vasilhame ou sacaria.'),
	(484, '5.921', 'Devolução de vasilhame ou sacaria', 'Classificam-se neste código as saídas por devolução de vasilhame ou sacaria.'),
	(485, '5.922', 'Lançamento efetuado a título de simples faturamento decorrente de venda para entrega futura', 'Classificam-se neste código os registros efetuados a título de simples faturamento decorrente de venda para entrega futura.'),
	(486, '5.923', 'Remessa de mercadoria por conta e ordem de terceiros, em venda à ordem', 'Classificam-se neste código as saídas correspondentes à entrega de mercadorias por conta e ordem de terceiros, em vendas à ordem, cuja venda ao adquirente originário, foi classificada nos códigos 5.118 - Venda de produção do estabelecimento entregue ao destinatário por conta e ordem do adquirente originário, em venda à ordem ou 5.119 - Venda de mercadoria adquirida ou recebida de terceiros entregue ao destinatário por conta e ordem do adquirente originário, em venda à ordem.'),
	(487, '5.924', 'Remessa para industrialização por conta e ordem do adquirente da mercadoria, quando esta não transitar pelo estabelecimento do adquirente', 'Classificam-se neste código as saídas de insumos com destino a estabelecimento industrializador, para serem industrializados por conta e ordem do adquirente, nas hipóteses em que os insumos não tenham transitado pelo estabelecimento do adquirente dos mesmos.'),
	(488, '5.925', 'Retorno de mercadoria recebida para industrialização por conta e ordem do adquirente da mercadoria, quando aquela não transitar pelo estabelecimento do adquirente', 'Classificam-se neste código as remessas, pelo estabelecimento industrializador, dos insumos recebidos, por conta e ordem do adquirente, para industrialização e incorporados ao produto final, nas hipóteses em que os insumos não tenham transitado pelo estabelecimento do adquirente. O valor dos insumos nesta operação deverá ser igual ao valor dos insumos recebidos para industrialização.'),
	(489, '5.926', 'Lançamento efetuado a título de reclassificação de mercadoria decorrente de formação de kit ou de sua desagregação', 'Classificam-se neste código os registros efetuados a título de reclassificação decorrente de formação de kit de mercadorias ou de sua desagregação.'),
	(490, '5.927', 'Lançamento efetuado a título de baixa de estoque decorrente de perda, roubo ou deterioração', 'Classificam-se neste código os registros efetuados a título de baixa de estoque decorrente de perda, roubo ou deterioração das mercadorias.'),
	(491, '5.928', 'Lançamento efetuado a título de baixa de estoque decorrente do encerramento da atividade da empresa', 'Classificam-se neste código os registros efetuados a título de baixa de estoque decorrente do encerramento das atividades da empresa.'),
	(492, '5.929', 'Lançamento efetuado em decorrência de emissão de documento fiscal relativo a operação ou prestação também registrada em equipamento Emissor de Cupom Fiscal - ECF', 'Classificam-se neste código os registros relativos aos documentos fiscais emitidos em operações ou prestações que também tenham sido registradas em equipamento Emissor de Cupom Fiscal - ECF.'),
	(493, '5.931', 'Lançamento efetuado em decorrência da responsabilidade de retenção do imposto por substituição tributária, atribuída ao remetente ou alienante da mercadoria, pelo serviço de transporte realizado por transportador autÃ´nomo ou por transportador não inscrito na unidade da Federação onde iniciado o serviço', 'Classificam-se neste código exclusivamente os lançamentos efetuados pelo remetente ou alienante da mercadoria quando lhe for atribuída a responsabilidade pelo recolhimento do imposto devido pelo serviço de transporte realizado por transportador autÃ´nomo ou por transportador não inscrito na unidade da Federação onde iniciado o serviço.'),
	(494, '5.932', 'Prestação de serviço de transporte iniciada em unidade da Federação diversa daquela onde inscrito o prestador', 'Classificam-se neste código as prestações de serviço de transporte que tenham sido iniciadas em unidade da Federação diversa daquela onde o prestador está inscrito como contribuinte.'),
	(495, '5.933', 'Prestação de serviço tributado pelo ISSQN', 'Classificam-se neste código as prestações de serviços, de competência municipal, desde que informados em documentos autorizados pelo Estado.'),
	(497, '5.949', 'Outra saída de mercadoria ou prestação de serviço não especificado', 'Classificam-se neste código as outras saídas de mercadorias ou prestações de serviços que não tenham sido especificados nos códigos anteriores.'),
	(502, '6.101', 'Venda de produção do estabelecimento', 'Classificam-se neste código as vendas de produtos industrializados no estabelecimento. Também serão classificadas neste código as vendas de mercadorias por estabelecimento industrial de cooperativa destinadas a seus cooperados ou a estabelecimento de outra cooperativa.'),
	(503, '6.102', 'Venda de mercadoria adquirida ou recebida de terceiros', 'Classificam-se neste código as vendas de mercadorias adquiridas ou recebidas de terceiros para industrialização ou comercialização, que não tenham sido objeto de qualquer processo industrial no estabelecimento. Também serão classificadas neste código as vendas de mercadorias por estabelecimento comercial de cooperativa destinadas a seus cooperados ou estabelecimento de outra cooperativa.'),
	(504, '6.103', 'Venda de produção do estabelecimento, efetuada fora do estabelecimento', 'Classificam-se neste código as vendas efetuadas fora do estabelecimento, inclusive por meio de veículo, de produtos industrializados no estabelecimento.'),
	(505, '6.104', 'Venda de mercadoria adquirida ou recebida de terceiros, efetuada fora do estabelecimento', 'Classificam-se neste código as vendas efetuadas fora do estabelecimento, inclusive por meio de veículo, de mercadorias adquiridas ou recebidas de terceiros para industrialização ou comercialização, que não tenham sido objeto de qualquer processo industrial no estabelecimento.'),
	(506, '6.105', 'Venda de produção do estabelecimento que não deva por ele transitar', 'Classificam-se neste código as vendas de produtos industrializados no estabelecimento, armazenados em depósito fechado, armazém geral ou outro sem que haja retorno ao estabelecimento depositante.'),
	(507, '6.106', 'Venda de mercadoria adquirida ou recebida de terceiros, que não deva por ele transitar', 'Classificam-se neste código as vendas de mercadorias adquiridas ou recebidas de terceiros para industrialização ou comercialização, armazenadas em depósito fechado, armazém geral ou outro, que não tenham sido objeto de qualquer processo industrial no estabelecimento sem que haja retorno ao estabelecimento depositante. Também serão classificadas neste código as vendas de mercadorias importadas, cuja saída ocorra do recinto alfandegado ou da repartição alfandegária onde se processou o desembaraço aduaneiro, com destino ao estabelecimento do comprador, sem transitar pelo estabelecimento do importador.'),
	(508, '6.107', 'Venda de produção do estabelecimento, destinada a não-contribuinte', 'Classificam-se neste código as vendas de produtos industrializados no estabelecimento, destinadas a não-contribuintes. Quaisquer operações de venda destinadas a não-contribuintes deverão ser classificadas neste código.'),
	(509, '6.108', 'Venda de mercadoria adquirida ou recebida de terceiros, destinada a não-contribuinte', 'Classificam-se neste código as vendas de mercadorias adquiridas ou recebidas de terceiros para industrialização ou comercialização, que não tenham sido objeto de qualquer processo industrial no estabelecimento, destinadas a não-contribuintes. Quaisquer operações de venda destinadas a não-contribuintes deverão ser classificadas neste código.'),
	(510, '6.109', 'Venda de produção do estabelecimento, destinada à Zona Franca de Manaus ou Áreas de Livre Comércio', 'Classificam-se neste código as vendas de produtos industrializados pelo estabelecimento, destinados à Zona Franca de Manaus ou Áreas de Livre Comércio, desde que alcançados pelos benefícios fiscais de que tratam o Decreto-lei nÂ° 288, de 28 de fevereiro de 1967, o Convênio ICM 65/88, de 6 de dezembro de 1988, o Convênio ICMS 36/97, de 23 de maio de 1997 e o Convênio ICMS 37/97, de 23 de maio de 1997.'),
	(511, '6.110', 'Venda de mercadoria adquirida ou recebida de terceiros, destinada à Zona Franca de Manaus ou Áreas de Livre Comércio', 'Classificam-se neste código as vendas de mercadorias adquiridas ou recebidas de terceiros, destinadas à Zona Franca de Manaus ou Áreas de Livre Comércio, desde que alcançadas pelos benefícios fiscais de que tratam o Decreto-lei nÂ° 288, de 28 de fevereiro de 1967, o Convênio ICM 65/88, de 6 de dezembro de 1988, o Convênio ICMS 36/97, de 23 de maio de 1997 e o Convênio ICMS 37/97, de 23 de maio de 1997.'),
	(512, '6.111', 'Venda de produção do estabelecimento remetida anteriormente em consignação industrial', 'Classificam-se neste código as vendas efetivas de produtos industrializados no estabelecimento remetidos anteriormente a título de consignação industrial.'),
	(513, '6.112', 'Venda de mercadoria adquirida ou recebida de terceiros remetida anteriormente em consignação industrial', 'Classificam-se neste código as vendas efetivas de mercadorias adquiridas ou recebidas de terceiros, que não tenham sido objeto de qualquer processo industrial no estabelecimento, remetidas anteriormente a título de consignação industrial.'),
	(514, '6.113', 'Venda de produção do estabelecimento remetida anteriormente em consignação mercantil', 'Classificam-se neste código as vendas efetivas de produtos industrializados no estabelecimento remetidos anteriormente a título de consignação mercantil.'),
	(515, '6.114', 'Venda de mercadoria adquirida ou recebida de terceiros remetida anteriormente em consignação mercantil', 'Classificam-se neste código as vendas efetivas de mercadorias adquiridas ou recebidas de terceiros, que não tenham sido objeto de qualquer processo industrial no estabelecimento, remetidas anteriormente a título de consignação mercantil.'),
	(516, '6.115', 'Venda de mercadoria adquirida ou recebida de terceiros, recebida anteriormente em consignação mercantil', 'Classificam-se neste código as vendas de mercadorias adquiridas ou recebidas de terceiros, recebidas anteriormente a título de consignação mercantil.'),
	(517, '6.116', 'Venda de produção do estabelecimento originada de encomenda para entrega futura', 'Classificam-se neste código as vendas de produtos industrializados pelo estabelecimento, quando da saída real do produto, cujo faturamento tenha sido classificado no código 6.922 - Lançamento efetuado a título de simples faturamento decorrente de venda para entrega futura.'),
	(518, '6.117', 'Venda de mercadoria adquirida ou recebida de terceiros, originada de encomenda para entrega futura', 'Classificam-se neste código as vendas de mercadorias adquiridas ou recebidas de terceiros, que não tenham sido objeto de qualquer processo industrial no estabelecimento, quando da saída real da mercadoria, cujo faturamento tenha sido classificado no código 6.922 - Lançamento efetuado a título de simples faturamento decorrente de venda para entrega futura.'),
	(519, '6.118', 'Venda de produção do estabelecimento entregue ao destinatário por conta e ordem do adquirente originário, em venda à ordem', 'Classificam-se neste código as vendas à ordem de produtos industrializados pelo estabelecimento, entregues ao destinatário por conta e ordem do adquirente originário.'),
	(520, '6.119', 'Venda de mercadoria adquirida ou recebida de terceiros entregue ao destinatário por conta e ordem do adquirente originário, em venda à ordem', 'Classificam-se neste código as vendas à ordem de mercadorias adquiridas ou recebidas de terceiros, que não tenham sido objeto de qualquer processo industrial no estabelecimento, entregues ao destinatário por conta e ordem do adquirente originário.'),
	(521, '6.120', 'Venda de mercadoria adquirida ou recebida de terceiros entregue ao destinatário pelo vendedor remetente, em venda à ordem', 'Classificam-se neste código as vendas à ordem de mercadorias adquiridas ou recebidas de terceiros, que não tenham sido objeto de qualquer processo industrial no estabelecimento, entregues pelo vendedor remetente ao destinatário, cuja compra seja classificada, pelo adquirente originário, no código 2.118 - Compra de mercadoria para comercialização pelo adquirente originário, entregue pelo vendedor remetente ao destinatário, em venda à ordem.'),
	(522, '6.122', 'Venda de produção do estabelecimento remetida para industrialização, por conta e ordem do adquirente, sem transitar pelo estabelecimento do adquirente', 'Classificam-se neste código as vendas de produtos industrializados no estabelecimento, remetidos para serem industrializados em outro estabelecimento, por conta e ordem do adquirente, sem que os produtos tenham transitado pelo estabelecimento do adquirente.'),
	(523, '6.123', 'Venda de mercadoria adquirida ou recebida de terceiros remetida para industrialização, por conta e ordem do adquirente, sem transitar pelo estabelecimento do adquirente', 'Classificam-se neste código as vendas de mercadorias adquiridas ou recebidas de terceiros, que não tenham sido objeto de qualquer processo industrial no estabelecimento, remetidas para serem industrializadas em outro estabelecimento, por conta e ordem do adquirente, sem que as mercadorias tenham transitado pelo estabelecimento do adquirente.'),
	(524, '6.124', 'Industrialização efetuada para outra empresa', 'Classificam-se neste código as saídas de mercadorias industrializadas para terceiros, compreendendo os valores referentes aos serviços prestados e os das mercadorias de propriedade do industrializador empregadas no processo industrial.'),
	(525, '6.125', 'Industrialização efetuada para outra empresa quando a mercadoria recebida para utilização no processo de industrialização não transitar pelo estabelecimento adquirente da mercadoria', 'Classificam-se neste código as saídas de mercadorias industrializadas para outras empresas, em que as mercadorias recebidas para utilização no processo de industrialização não tenham transitado pelo estabelecimento do adquirente das mercadorias, compreendendo os valores referentes aos serviços prestados e os das mercadorias de propriedade do industrializador empregadas no processo industrial.'),
	(529, '6.151', 'Transferência de produção do estabelecimento', 'Classificam-se neste código os produtos industrializados no estabelecimento e transferidos para outro estabelecimento da mesma empresa.'),
	(530, '6.152', 'Transferência de mercadoria adquirida ou recebida de terceiros', 'Classificam-se neste código as mercadorias adquiridas ou recebidas de terceiros para industrialização, comercialização ou para utilização na prestação de serviços e que não tenham sido objeto de qualquer processo industrial no estabelecimento, transferidas para outro estabelecimento da mesma empresa.'),
	(531, '6.153', 'Transferência de energia elétrica', 'Classificam-se neste código as transferências de energia elétrica para outro estabelecimento da mesma empresa, para distribuição.'),
	(532, '6.155', 'Transferência de produção do estabelecimento, que não deva por ele transitar', 'Classificam-se neste código as transferências para outro estabelecimento da mesma empresa, de produtos industrializados no estabelecimento que tenham sido remetidos para armazém geral, depósito fechado ou outro, sem que haja retorno ao estabelecimento depositante.'),
	(533, '6.156', 'Transferência de mercadoria adquirida ou recebida de terceiros, que não deva por ele transitar', 'Classificam-se neste código as transferências para outro estabelecimento da mesma empresa, de mercadorias adquiridas ou recebidas de terceiros para industrialização ou comercialização, que não tenham sido objeto de qualquer processo industrial, remetidas para armazém geral, depósito fechado ou outro, sem que haja retorno ao estabelecimento depositante.'),
	(536, '6.201', 'Devolução de compra para industrialização', 'Classificam-se neste código as devoluções de mercadorias adquiridas para serem utilizadas em processo de industrialização, cujas entradas tenham sido classificadas como Compra para industrialização.'),
	(537, '6.202', 'Devolução de compra para comercialização', 'Classificam-se neste código as devoluções de mercadorias adquiridas para serem comercializadas, cujas entradas tenham sido classificadas como Compra para comercialização.'),
	(538, '6.205', 'Anulação de valor relativo a aquisição de serviço de comunicação', 'Classificam-se neste código as anulações correspondentes a valores faturados indevidamente, decorrentes das aquisições de serviços de comunicação.'),
	(539, '6.206', 'Anulação de valor relativo a aquisição de serviço de transporte', 'Classificam-se neste código as anulações correspondentes a valores faturados indevidamente, decorrentes das aquisições de serviços de transporte.'),
	(540, '6.207', 'Anulação de valor relativo à compra de energia elétrica', 'Classificam-se neste código as anulações correspondentes a valores faturados indevidamente, decorrentes da compra de energia elétrica.'),
	(541, '6.208', 'Devolução de mercadoria recebida em transferência para industrialização', 'Classificam-se neste código as devoluções de mercadorias recebidas em transferência de outros estabelecimentos da mesma empresa, para serem utilizadas em processo de industrialização.'),
	(542, '6.209', 'Devolução de mercadoria recebida em transferência para comercialização', 'Classificam-se neste código as devoluções de mercadorias recebidas em transferência de outro estabelecimento da mesma empresa, para serem comercializadas.'),
	(543, '6.210', 'Devolução de compra para utilização na prestação de serviço', 'Classificam-se neste código as devoluções de mercadorias adquiridas para utilização na prestação de serviços, cujas entradas tenham sido classificadas no código 2.126 - Compra para utilização na prestação de serviço.'),
	(546, '6.251', 'Venda de energia elétrica para distribuição ou comercialização', 'Classificam-se neste código as vendas de energia elétrica destinada à distribuição ou comercialização. Também serão classificadas neste código as vendas de energia elétrica destinada a cooperativas para distribuição aos seus cooperados.'),
	(547, '6.252', 'Venda de energia elétrica para estabelecimento industrial', 'Classificam-se neste código as vendas de energia elétrica para consumo por estabelecimento industrial. Também serão classificadas neste código as vendas de energia elétrica destinada a estabelecimento industrial de cooperativa.'),
	(548, '6.253', 'Venda de energia elétrica para estabelecimento comercial', 'Classificam-se neste código as vendas de energia elétrica para consumo por estabelecimento comercial. Também serão classificadas neste código as vendas de energia elétrica destinada a estabelecimento comercial de cooperativa.'),
	(549, '6.254', 'Venda de energia elétrica para estabelecimento prestador de serviço de transporte', 'Classificam-se neste código as vendas de energia elétrica para consumo por estabelecimento de prestador de serviços de transporte.'),
	(550, '6.255', 'Venda de energia elétrica para estabelecimento prestador de serviço de comunicação', 'Classificam-se neste código as vendas de energia elétrica para consumo por estabelecimento de prestador de serviços de comunicação.'),
	(551, '6.256', 'Venda de energia elétrica para estabelecimento de produtor rural', 'Classificam-se neste código as vendas de energia elétrica para consumo por estabelecimento de produtor rural.'),
	(552, '6.257', 'Venda de energia elétrica para consumo por demanda contratada', 'Classificam-se neste código as vendas de energia elétrica para consumo por demanda contratada, que prevalecerá sobre os demais códigos deste subgrupo.'),
	(553, '6.258', 'Venda de energia elétrica a não-contribuinte', 'Classificam-se neste código as vendas de energia elétrica a pessoas físicas ou a pessoas jurídicas não indicadas nos códigos anteriores.'),
	(556, '6.301', 'Prestação de serviço de comunicação para execução de serviço da mesma natureza', 'Classificam-se neste código as prestações de serviços de comunicação destinados às prestações de serviços da mesma natureza.'),
	(557, '6.302', 'Prestação de serviço de comunicação a estabelecimento industrial', 'Classificam-se neste código as prestações de serviços de comunicação a estabelecimento industrial. Também serão classificados neste código os serviços de comunicação prestados a estabelecimento industrial de cooperativa.'),
	(558, '6.303', 'Prestação de serviço de comunicação a estabelecimento comercial', 'Classificam-se neste código as prestações de serviços de comunicação a estabelecimento comercial. Também serão classificados neste código os serviços de comunicação prestados a estabelecimento comercial de cooperativa.'),
	(559, '6.304', 'Prestação de serviço de comunicação a estabelecimento de prestador de serviço de transporte', 'Classificam-se neste código as prestações de serviços de comunicação a estabelecimento prestador de serviço de transporte.'),
	(560, '6.305', 'Prestação de serviço de comunicação a estabelecimento de geradora ou de distribuidora de energia elétrica', 'Classificam-se neste código as prestações de serviços de comunicação a estabelecimento de geradora ou de distribuidora de energia elétrica.'),
	(561, '6.306', 'Prestação de serviço de comunicação a estabelecimento de produtor rural', 'Classificam-se neste código as prestações de serviços de comunicação a estabelecimento de produtor rural.'),
	(562, '6.307', 'Prestação de serviço de comunicação a não-contribuinte', 'Classificam-se neste código as prestações de serviços de comunicação a pessoas físicas ou a pessoas jurídicas não indicadas nos códigos anteriores.'),
	(565, '6.351', 'Prestação de serviço de transporte para execução de serviço da mesma natureza', 'Classificam-se neste código as prestações de serviços de transporte destinados às prestações de serviços da mesma natureza.'),
	(566, '6.352', 'Prestação de serviço de transporte a estabelecimento industrial', 'Classificam-se neste código as prestações de serviços de transporte a estabelecimento industrial. Também serão classificados neste código os serviços de transporte prestados a estabelecimento industrial de cooperativa.'),
	(567, '6.353', 'Prestação de serviço de transporte a estabelecimento comercial', 'Classificam-se neste código as prestações de serviços de transporte a estabelecimento comercial. Também serão classificados neste código os serviços de transporte prestados a estabelecimento comercial de cooperativa.'),
	(568, '6.354', 'Prestação de serviço de transporte a estabelecimento de prestador de serviço de comunicação', 'Classificam-se neste código as prestações de serviços de transporte a estabelecimento prestador de serviços de comunicação.'),
	(569, '6.355', 'Prestação de serviço de transporte a estabelecimento de geradora ou de distribuidora de energia elétrica', 'Classificam-se neste código as prestações de serviços de transporte a estabelecimento de geradora ou de distribuidora de energia elétrica.'),
	(570, '6.356', 'Prestação de serviço de transporte a estabelecimento de produtor rural', 'Classificam-se neste código as prestações de serviços de transporte a estabelecimento de produtor rural.'),
	(571, '6.357', 'Prestação de serviço de transporte a não-contribuinte', 'Classificam-se neste código as prestações de serviços de transporte a pessoas físicas ou a pessoas jurídicas não indicadas nos códigos anteriores.'),
	(572, '6.359', 'Prestação de serviço de transporte a contribuinte ou a não contribuinte quando a mercadoria transportada está dispensada de emissão de nota fiscal.', 'Classificam-se neste código as prestações de serviços de transporte a contribuintes ou a não contribuintes, exclusivamente quando não existe a obrigação legal de emissão de nota fiscal para a mercadoria transportada. '),
	(576, '6.401', 'Venda de produção do estabelecimento em operação com produto sujeito ao regime de substituição tributária, na condição de contribuinte substituto', 'Classificam-se neste código as vendas de produtos industrializados no estabelecimento em operações com produtos sujeitos ao regime de substituição tributária, na condição de contribuinte substituto. Também serão classificadas neste código as vendas de produtos industrializados por estabelecimento industrial de cooperativa sujeitos ao regime de substituição tributária, na condição de contribuinte substituto.'),
	(577, '6.402', 'Venda de produção do estabelecimento de produto sujeito ao regime de substituição tributária, em operação entre contribuintes substitutos do mesmo produto', 'Classificam-se neste código as vendas de produtos sujeitos ao regime de substituição tributária industrializados no estabelecimento, em operações entre contribuintes substitutos do mesmo produto.'),
	(578, '6.403', 'Venda de mercadoria adquirida ou recebida de terceiros em operação com mercadoria sujeita ao regime de substituição tributária, na condição de contribuinte substituto', 'Classificam-se neste código as vendas de mercadorias adquiridas ou recebidas de terceiros, na condição de contribuinte substituto, em operação com mercadorias sujeitas ao regime de substituição tributária.'),
	(579, '6.404', 'Venda de mercadoria sujeita ao regime de substituição tributária, cujo imposto já tenha sido retido anteriormente', 'Classificam-se neste código as vendas de mercadorias sujeitas ao regime de substituição tributária, na condição de substituto tributário, exclusivamente nas hipóteses em que o imposto já tenha sido retido anteriormente.'),
	(580, '6.408', 'Transferência de produção do estabelecimento em operação com produto sujeito ao regime de substituição tributária', 'Classificam-se neste código os produtos industrializados no estabelecimento e transferidos para outro estabelecimento da mesma empresa, em operações com produtos sujeitos ao regime de substituição tributária.'),
	(581, '6.409', 'Transferência de mercadoria adquirida ou recebida de terceiros em operação com mercadoria sujeita ao regime de substituição tributária', 'Classificam-se neste código as transferências para outro estabelecimento da mesma empresa, de mercadorias adquiridas ou recebidas de terceiros que não tenham sido objeto de qualquer processo industrial no estabelecimento, em operações com mercadorias sujeitas ao regime de substituição tributária.'),
	(582, '6.410', 'Devolução de compra para industrialização em operação com mercadoria sujeita ao regime de substituição tributária', 'Classificam-se neste código as devoluções de mercadorias adquiridas para serem utilizadas em processo de industrialização cujas entradas tenham sido classificadas como Compra para industrialização em operação com mercadoria sujeita ao regime de substituição tributária.'),
	(583, '6.411', 'Devolução de compra para comercialização em operação com mercadoria sujeita ao regime de substituição tributária', 'Classificam-se neste código as devoluções de mercadorias adquiridas para serem comercializadas, cujas entradas tenham sido classificadas como Compra para comercialização em operação com mercadoria sujeita ao regime de substituição tributária.'),
	(584, '6.412', 'Devolução de bem do ativo imobilizado, em operação com mercadoria sujeita ao regime de substituição tributária', 'Classificam-se neste código as devoluções de bens adquiridos para integrar o ativo imobilizado do estabelecimento, cuja entrada tenha sido classificada no código 2.406 - Compra de bem para o ativo imobilizado cuja mercadoria está sujeita ao regime de substituição tributária.'),
	(585, '6.413', 'Devolução de mercadoria destinada ao uso ou consumo, em operação com mercadoria sujeita ao regime de substituição tributária', 'Classificam-se neste código as devoluções de mercadorias adquiridas para uso ou consumo do estabelecimento, cuja entrada tenha sido classificada no código 2.407 - Compra de mercadoria para uso ou consumo cuja mercadoria está sujeita ao regime de substituição tributária.'),
	(586, '6.414', 'Remessa de produção do estabelecimento para venda fora do estabelecimento em operação com produto sujeito ao regime de substituição tributária', 'Classificam-se neste código as remessas de produtos industrializados pelo estabelecimento para serem vendidos fora do estabelecimento, inclusive por meio de veículos, em operações com produtos sujeitos ao regime de substituição tributária.'),
	(587, '6.415', 'Remessa de mercadoria adquirida ou recebida de terceiros para venda fora do estabelecimento, em operação com mercadoria sujeita ao regime de substituição tributária', 'Classificam-se neste código as remessas de mercadorias adquiridas ou recebidas de terceiros para serem vendidas fora do estabelecimento, inclusive por meio de veículos, em operações com mercadorias sujeitas ao regime de substituição tributária.'),
	(590, '6.501', 'Remessa de produção do estabelecimento, com fim específico de exportação', 'Classificam-se neste código as saídas de produtos industrializados pelo estabelecimento, remetidos com fim específico de exportação a trading company, empresa comercial exportadora ou outro estabelecimento do remetente.'),
	(591, '6.502', 'Remessa de mercadoria adquirida ou recebida de terceiros, com fim específico de exportação', 'Classificam-se neste código as saídas de mercadorias adquiridas ou recebidas de terceiros, remetidas com fim específico de exportação a trading company, empresa comercial exportadora ou outro estabelecimento do remetente.'),
	(592, '6.503', 'Devolução de mercadoria recebida com fim específico de exportação', 'Classificam-se neste código as devoluções efetuadas por trading company, empresa comercial exportadora ou outro estabelecimento do destinatário, de mercadorias recebidas com fim específico de exportação, cujas entradas tenham sido classificadas no código 2.501 - Entrada de mercadoria recebida com fim específico de exportação.'),
	(595, '6.551', 'Venda de bem do ativo imobilizado', 'Classificam-se neste código as vendas de bens integrantes do ativo imobilizado do estabelecimento.'),
	(596, '6.552', 'Transferência de bem do ativo imobilizado', 'Classificam-se neste código os bens do ativo imobilizado transferidos para outro estabelecimento da mesma empresa.'),
	(598, '6.553', 'Devolução de compra de bem para o ativo imobilizado', 'Classificam-se neste código as devoluções de bens adquiridos para integrar o ativo imobilizado do estabelecimento, cuja entrada foi classificada no código 2.551 - Compra de bem para o ativo imobilizado.'),
	(599, '6.554', 'Remessa de bem do ativo imobilizado para uso fora do estabelecimento', 'Classificam-se neste código as remessas de bens do ativo imobilizado para uso fora do estabelecimento.'),
	(600, '6.555', 'Devolução de bem do ativo imobilizado de terceiro, recebido para uso no estabelecimento', 'Classificam-se neste código as saídas em devolução, de bens do ativo imobilizado de terceiros, recebidos para uso no estabelecimento, cuja entrada tenha sido classificada no código 2.555 - Entrada de bem do ativo imobilizado de terceiro, remetido para uso no estabelecimento.'),
	(601, '6.556', 'Devolução de compra de material de uso ou consumo', 'Classificam-se neste código as devoluções de mercadorias destinadas ao uso ou consumo do estabelecimento, cuja entrada tenha sido classificada no código 2.556 - Compra de material para uso ou consumo.'),
	(602, '6.557', 'Transferência de material de uso ou consumo', 'Classificam-se neste código os materiais de uso ou consumo transferidos para outro estabelecimento da mesma empresa.'),
	(604, '6.603', 'Ressarcimento de ICMS retido por substituição tributária', 'Classificam-se neste código os lançamentos destinados ao registro de ressarcimento de ICMS retido por substituição tributária a contribuinte substituído, efetuado pelo contribuinte substituto, nas hipóteses previstas na legislação aplicável.'),
	(606, '6.651', 'Venda de combustível ou lubrificante de produção do estabelecimento destinado à industrialização subsequente', 'Classificam-se neste código as vendas de combustíveis ou lubrificantes industrializados no estabelecimento destinados à industrialização do próprio produto, inclusive aquelas decorrentes de encomenda para entrega futura, cujo faturamento tenha sido classificado no código 6.922 â€“ Lançamento efetuado a título de simples faturamento decorrente de venda para entrega futura.'),
	(607, '6.652', 'Venda de combustível ou lubrificante de produção do estabelecimento destinado à comercialização', 'Classificam-se neste código as vendas de combustíveis ou lubrificantes industrializados no estabelecimento destinados à comercialização, inclusive aquelas decorrentes de encomenda para entrega futura, cujo faturamento tenha sido classificado no código 6.922 â€“ Lançamento efetuado a título de simples faturamento decorrente de venda para entrega futura.'),
	(608, '6.653', 'Venda de combustível ou lubrificante de produção do estabelecimento destinado a consumidor ou usuário final', 'Classificam-se neste código as vendas de combustíveis ou lubrificantes industrializados no estabelecimento destinados a consumo em processo de industrialização de outros produtos, à prestação de serviços ou a usuário final, inclusive aquelas decorrentes de encomenda para entrega futura, cujo faturamento tenha sido classificado no código 6.922 â€“ Lançamento efetuado a título de simples faturamento decorrente de venda para entrega futura.'),
	(609, '6.654', 'Venda de combustível ou lubrificante adquirido ou recebido de terceiros destinado à industrialização subsequente', 'Classificam-se neste código as vendas de  combustíveis ou lubrificantes adquiridos ou recebidos de terceiros destinados à industrialização do próprio produto, inclusive aquelas decorrentes de encomenda para entrega futura, cujo faturamento tenha sido classificado no código 5.922 â€“ Lançamento efetuado a título de simples faturamento decorrente de venda para entrega futura. '),
	(610, '6.655', 'Venda de combustível ou lubrificante adquirido ou recebido de terceiros destinado à comercialização', 'Classificam-se neste código as vendas de  combustíveis ou lubrificantes adquiridos ou recebidos de terceiros destinados à comercialização, inclusive aquelas decorrentes de encomenda para entrega futura, cujo faturamento tenha sido classificado no código 5.922 â€“ Lançamento efetuado a título de simples faturamento decorrente de venda para entrega futura.'),
	(611, '6.656', 'Venda de combustível ou lubrificante adquirido ou recebido de terceiros destinado a consumidor ou usuário final', 'Classificam-se neste código as vendas de  combustíveis ou lubrificantes adquiridos ou recebidos de terceiros destinados a consumo em processo de industrialização de outros produtos, à prestação de serviços ou a usuário final, inclusive aquelas decorrentes de encomenda para entrega futura, cujo faturamento tenha sido classificado no código 5.922 â€“ Lançamento efetuado a título de simples faturamento decorrente de venda para entrega futura.'),
	(612, '6.657', 'Remessa de combustível ou lubrificante adquirido ou recebido de terceiros para venda fora do estabelecimento', 'Classificam-se neste código as remessas de combustíveis ou lubrificante, adquiridos ou recebidos de terceiros para serem vendidos fora do estabelecimento, inclusive por meio de veículos.'),
	(613, '6.658', 'Transferência de combustível ou lubrificante de produção do estabelecimento ', 'Classificam-se neste código as transferências de combustíveis ou lubrificantes, industrializados no estabelecimento, para outro estabelecimento da mesma empresa.'),
	(614, '6.659', 'Transferência de combustível ou lubrificante adquirido ou recebido de terceiro', 'Classificam-se neste código as transferências de combustíveis ou lubrificantes, adquiridos ou recebidos de terceiros, para outro estabelecimento da mesma empresa.'),
	(616, '6.660', 'Devolução de compra de combustível ou lubrificante adquirido para industrialização subsequente', 'Classificam-se neste código as devoluções de compras de combustíveis ou lubrificantes adquiridos para industrialização do próprio produto, cujas entradas tenham sido classificadas como Compra de combustível ou lubrificante para industrialização subsequente.'),
	(617, '6.661', 'Devolução de compra de combustível ou lubrificante adquirido para comercialização', 'Classificam-se neste código as devoluções de compras de combustíveis ou lubrificantes adquiridos para comercialização, cujas entradas tenham sido classificadas como Compra de combustível ou lubrificante para comercialização.'),
	(618, '6.662', 'Devolução de compra de combustível ou lubrificante adquirido por consumidor ou usuário final', 'Classificam-se neste código as devoluções de compras de combustíveis ou lubrificantes adquiridos para consumo em processo de industrialização de outros produtos, na prestação de serviços ou por usuário final, cujas entradas tenham sido classificadas como Compra de combustível ou lubrificante por consumidor ou usuário final.'),
	(619, '6.663', 'Remessa para armazenagem de combustível ou lubrificante', 'Classificam-se neste código as remessas para armazenagem de combustíveis ou lubrificantes.'),
	(620, '6.664', 'Retorno de combustível ou lubrificante recebido para armazenagem', 'Classificam-se neste código as remessas em devolução de combustíveis ou lubrificantes, recebidos para armazenagem.'),
	(621, '6.665', 'Retorno simbólico de combustível ou lubrificante recebido para armazenagem', 'Classificam-se neste código os retornos simbólicos de combustíveis ou lubrificantes recebidos para armazenagem, quando as mercadorias armazenadas tenham sido objeto de saída a qualquer título e não devam retornar ao estabelecimento depositante.'),
	(622, '6.666', 'Remessa por conta e ordem de terceiros de combustível ou lubrificante recebido para armazenagem', 'Classificam-se neste código as saídas por conta e ordem de terceiros, de combustíveis ou lubrificantes, recebidos anteriormente para armazenagem.'),
	(625, '6.901', 'Remessa para industrialização por encomenda', 'Classificam-se neste código as remessas de insumos remetidos para industrialização por encomenda, a ser realizada em outra empresa ou em outro estabelecimento da mesma empresa.'),
	(626, '6.902', 'Retorno de mercadoria utilizada na industrialização por encomenda', 'Classificam-se neste código as remessas, pelo estabelecimento industrializador, dos insumos recebidos para industrialização e incorporados ao produto final, por encomenda de outra empresa ou de outro estabelecimento da mesma empresa. O valor dos insumos nesta operação deverá ser igual ao valor dos insumos recebidos para industrialização.'),
	(627, '6.903', 'Retorno de mercadoria recebida para industrialização e não aplicada no referido processo', 'Classificam-se neste código as remessas em devolução de insumos recebidos para industrialização e não aplicados no referido processo.'),
	(628, '6.904', 'Remessa para venda fora do estabelecimento', 'Classificam-se neste código as remessas de mercadorias para venda fora do estabelecimento, inclusive por meio de veículos.'),
	(629, '6.905', 'Remessa para depósito fechado ou armazém geral', 'Classificam-se neste código as remessas de mercadorias para depósito em depósito fechado ou armazém geral.'),
	(630, '6.906', 'Retorno de mercadoria depositada em depósito fechado ou armazém geral', 'Classificam-se neste código os retornos de mercadorias depositadas em depósito fechado ou armazém geral ao estabelecimento depositante.'),
	(631, '6.907', 'Retorno simbólico de mercadoria depositada em depósito fechado ou armazém geral', 'Classificam-se neste código os retornos simbólicos de mercadorias recebidas para depósito em depósito fechado ou armazém geral, quando as mercadorias depositadas tenham sido objeto de saída a qualquer título e que não devam retornar ao estabelecimento depositante.'),
	(632, '6.908', 'Remessa de bem por conta de contrato de comodato', 'Classificam-se neste código as remessas de bens para o cumprimento de contrato de comodato.'),
	(633, '6.909', 'Retorno de bem recebido por conta de contrato de comodato', 'Classificam-se neste código as remessas de bens em devolução após cumprido o contrato de comodato.'),
	(634, '6.910', 'Remessa em bonificação, doação ou brinde', 'Classificam-se neste código as remessas de mercadorias a título de bonificação, doação ou brinde.'),
	(635, '6.911', 'Remessa de amostra grátis', 'Classificam-se neste código as remessas de mercadorias a título de amostra grátis.'),
	(636, '6.912', 'Remessa de mercadoria ou bem para demonstração', 'Classificam-se neste código as remessas de mercadorias ou bens para demonstração.'),
	(637, '6.913', 'Retorno de mercadoria ou bem recebido para demonstração', 'Classificam-se neste código as remessas em devolução de mercadorias ou bens recebidos para demonstração.'),
	(638, '6.914', 'Remessa de mercadoria ou bem para exposição ou feira', 'Classificam-se neste código as remessas de mercadorias ou bens para exposição ou feira.'),
