	(683, '7.358', 'Prestação de serviço de transporte', 'Classificam-se neste código as prestações de serviços de transporte destinado a estabelecimento no exterior.'),
	(686, '7.501', 'Exportação de mercadorias recebidas com fim específico de exportação', 'Classificam-se neste código as exportações das mercadorias recebidas anteriormente com finalidade específica de exportação, cujas entradas tenham sido classificadas nos códigos 1.501 - Entrada de mercadoria recebida com fim específico de exportação ou 2.501 - Entrada de mercadoria recebida com fim específico de exportação.'),
	(689, '7.551', 'Venda de bem do ativo imobilizado', 'Classificam-se neste código as vendas de bens integrantes do ativo imobilizado do estabelecimento.'),
	(690, '7.553', 'Devolução de compra de bem para o ativo imobilizado', 'Classificam-se neste código as devoluções de bens adquiridos para integrar o ativo imobilizado do estabelecimento, cuja entrada foi classificada no código 3.551 - Compra de bem para o ativo imobilizado.'),
	(691, '7.556', 'Devolução de compra de material de uso ou consumo', 'Classificam-se neste código as devoluções de mercadorias destinadas ao uso ou consumo do estabelecimento, cuja entrada tenha sido classificada no código 3.556 - Compra de material para uso ou consumo.'),
	(693, '7.651', 'Venda de combustível ou lubrificante de produção do estabelecimento', 'Classificam-se neste código as vendas de combustíveis ou lubrificantes industrializados no estabelecimento destinados ao exterior.'),
	(695, '7.654', 'Venda de combustível ou lubrificante adquirido ou recebido de terceiros', 'Classificam-se neste código as vendas de combustíveis ou lubrificantes adquiridos ou recebidos de terceiros destinados ao exterior.'),
	(699, '7.930', 'Lançamento efetuado a título de devolução de bem cuja entrada tenha ocorrido sob amparo de regime especial aduaneiro de admissão temporária', 'Classificam-se neste código os lançamentos efetuados a título de saída em devolução de bens cuja entrada tenha ocorrido sob amparo de regime especial aduaneiro de admissão temporária.'),
	(700, '7.949', 'Outra saída de mercadoria ou prestação de serviço não especificado', 'Classificam-se neste código as outras saídas de mercadorias ou prestações de serviços que não tenham sido especificados nos códigos anteriores.'),
